(11914, 'FORESTDALE', 'Förlängningsbart matbord i massivt ljusbrunt betsat amerikansk körsbärsträ.  Iläggskivor förvaras i matbordet.\r\nDimensioner: L. 160-245 (inkl 2 iläggskivor á 42,5 cm) B.  90   H. 77 cm. Går även att få i större storlekar.\r\nMaterial: Massiv körsbär\r\nFärg: Spanish. Finns även i English\r\n\r\nNewport möbler\r\nThe Cherry Collection från Newport är en ny serie möbler tillverkade av massiv amerikansk körsbär med ett enkelt formspråk inspirerat av New Englands tidiga \"Shaker Movement\". Shakers blev kända för sina gårdstillverkade möbler med mångsidig funktion, enkel stil, genuina träslag och lagom mycket utsmyckning. En stor del av New Englands inredning, både antik och nytillverkad, är baserad på Shaker-rörelsens stilrena bord, stolar och skåp. De ljust betsade möblerna är mycket omtyckta och är tillverkade för att hålla i flera generationer. Den klassiska möbelserien tillverkas i Europa och produktionen sker hantverksmässigt i egen regi med högsta kvalitet, materialval och omsorg.', 0),
