(16359, 'Konsolbord Metropole', 'Om Eichholtz\r\nMed inspiration från hela världen skapar holländska företaget Eichholtz sofistikerade möbler och inredningsdetaljer med en europeisk elegans och stil. Deras klassiska möbelkollektioner och glamorösa inredningsdetaljer är av yppersta kvalitet och återfinns i exklusiva hem världen över sedan mer än 20 år tillbaka. Företaget grundades för 20 år sedan av Theo Eichholtz, som fick idén att importera möbler från Asien under sina resor. Det som började med möbelexport från Indonesien har idag vuxit till ett företag som levererar möbler och accessoarer tillverkade i Burma, Indien, Kina och Thailand utifrån egen design. Gemensamt för alla produkter från Eichholtz är, oavsett olika stilar, att de genomsyras av högsta kvalitet och en god känsla för såväl klassisk som modern inredning.', 420),
