(19661, 'Miss Lola ', 'Miss Lola\r\nAtt planlöst vandra gatorna fram och ändå få någonting absolut meningsfullt gjort är lite av Miss Lolas talang. Plötsligt står det en ensam människa i hennes väg, med ett obeskrivligt behov av guidning, sällskap eller bara mänsklig närhet. Som om det vore det mest självklara i hela vida världen, ägnar Lola sin tid åt uppmärksamhet, det som så ofta är det mest saknade och basala behovet hos ensamma och övergivna. En liten gest som kan förändra någons liv, ett leende, en kram...', 269),
(19664, 'Mr Jack ', '', 269),
(19666, 'Miss Vivienne & Miss Lola 2-pack', 'Miss Vivienne \r\nMiss Vivienne har en magisk egenskap. Hon kan para ihop människor som tappat bort sin kompass, mist sitt fotfäste och förlorat meningen med livet. Hon får vilsna människor att hitta varandra och tillsammans upptäcka glädjen. Vivienne sitter på sin balkong med utsikt över taknockar och vädringsbalkonger, omringad av blomstrande balkonglådor och spanar efter signaler - mellan dagdrömmarna är hon redo att gripa in…\r\n\r\nMiss Lola\r\nAtt planlöst vandra gatorna fram och ändå få någonting absolut meningsfullt gjort är lite av Miss Lolas talang. Plötsligt står det en ensam människa i hennes väg, med ett obeskrivligt behov av guidning, sällskap eller bara mänsklig närhet. Som om det vore det mest självklara i hela vida världen, ägnar Lola sin tid åt uppmärksamhet, det som så ofta är det mest saknade och basala behovet hos ensamma och övergivna. En liten gest som kan förändra någons liv, ett leende, en kram...', 269),
