(23080, 'Glaskaraff Paris Bärnsten 2 liter', 'Vacker och tidlös karaff, som tillverkas i ett litet traditionellt glasbruk.. Fin att använda både till svala drycker eller som vas. De munblåsta bubblorna ger glaset dess karaktäristiska mönster och sätter en unik prägel på dukningen. De flera delarna av karaffarer, skålar och vaser ur samma kollektion, är fina både var och för sig eller samlade i grupp.  En unik serie munblåsta produkter, där tillbringaren blivit en klassisk detalj och uppsakattad gåva, ofta omnämnd som Linné Carafe. ', 193),
