(25110, 'Stol Newport Orleans', 'Stol i massivt ljusbrunt betsat amerikansk körsbärsträ med stoppad sits i off-white färgat tyg. Dimensioner B. 49 cm D. 53 cm H.  96/46 cm. Material: Massiv körsbär. Färg: Vit\r\nGår även få i mörkbrunt betsad körsbär.\r\n\r\nNewport möbler\r\nThe Cherry Collection från Newport är en ny serie möbler tillverkade av massiv amerikansk körsbär med ett enkelt formspråk inspirerat av New Englands tidiga \"Shaker Movement\". Shakers blev kända för sina gårdstillverkade möbler med mångsidig funktion, enkel stil, genuina träslag och lagom mycket utsmyckning. En stor del av New Englands inredning, både antik och nytillverkad, är baserad på Shaker-rörelsens stilrena bord, stolar och skåp. De mörkt betsade möblerna är mycket omtyckta och är tillverkade för att hålla i flera generationer. Den klassiska möbelserien tillverkas i Europa och produktionen sker hantverksmässigt i egen regi med högsta kvalitet, materialval och omsorg', 125),
