(25191, 'Body Lotion Milk Cotton ', 'En härlig kroppslotion som är återfuktande och närande. Skyddar din hud och gör den mjuk och fin. Paraben och SLS fria med naturliga dofter. En mjuk och krämig doft tar dig på en resa genom de gröna ängarna på Schweiziska alpern', 283),
(25192, 'Shower Gel Milk Cotton ', 'En härligt krämig rengöring för huden ger en silkesmjuk känsla och har en återfuktande effekt.  En mjuk och krämig doft tar dig på en resa genom de gröna ängarna på Schweiziska alperna.\r\n\r\nProdukterna är paraben och SLS fria med naturliga dofter.', 283),
(25193, 'Hand Cream Milk Cotton ', 'En magisk handkräm med 20% sheasmör som vårdar och skyddar dina händer. Innehåller glycerin, avokadoolja som ger ett rikt fuktskydd. Ros, nypon och apelsinolja som lugnar och läker. Ett måste för torra händer, passar även prefekt till fötter. En mjuk och krämig doft tar dig på en resa genom de gröna ängarna på Schweiziska alperna.', 284),
(25196, 'Body Lotion Verbena', 'En härlig kroppslotion som är återfuktande och närande. Skyddar din hud och gör den mjuk och fin. Paraben och SLS fria med naturliga dofter. Spansk verbena som ger den söta citrus doft, är så ljuvlig att den är omotståndlig och uppfriskande för kropp och själ.', 283),
(25197, 'Hand Wash Verbena', 'Flytande handtvål som rengör skonsamt och är återfuktande. Lämnar huden lätt parfymerad. Spansk verbena som ger den söta citrus doft, är så ljuvlig att den är omotståndlig och\r\nuppfriskande för kropp och själ.\r\n\r\nParaben och SLS fria med naturliga dofter.', 285),
