(25515, 'Nagel Stoff - Ljusstake Krom - 1st modul ', 'Nagel Stoff ljusstake 4st moduler. Reproduktion av Caesar Stoff för Fritz Nagel modulljusstake från 1965. Säljs i byggbara moduler. Kommer i en snygg presentförpackning. Varje modul är 6,5 cm hög och 10 cm bred. Reproduktionen av Nagelljusstakarna sker under licens med Nagel Gmbh, helt efter originalet. Ljusstaken är anpassad till en mindre storlek av stearinljus, 13 mm i diameter, men är även vacker som en skulptur utan ljus. Köp flera moduler och sätt samman till din egen unika Stoff ljusstake.', 160),
