(25533, 'Liljan Ljusstake Silver', 'Ivar Ålenius Björk (1905 - 1978) arbetade som skulptör och är mest känd för sina byster. Hans offentliga utsmyckningar kan idag ses i många svenska städer. Ivar Ålenius Björk utformade en serie ljusstakar i mässing för den svenska tillverkaren Ystad-Metall som lades ner år 1969. Liljan var en av dessa ljusstakar och den har blivit en modern designklassiker som har förekommit i många internationella inredningar. I samarbete med Ivar Ålenius Björks anhöriga har Skultuna nu startat produktionen av Liljan igen. Designad för världsutställningen i New York 1939.', 160),
