(25618, 'Sparbössa Elefant Marble Maxi ', 'Underbara elefantsparbössor som ger en fin färgklick i barnrummet! En perfekt dopgåva eller födelsedagspresent till stor som liten. De flesta människor känner igen dessa sparbössor, åtminstone de som är födda i Sverige på 70-talet eller tidigare. Sparbössorna delades ursprungligen ut av Föreningsbanken för att främja sparande bland barn och tonåringar. Nu är de här igen, tillverkad i samma form och i samma fabrik i Finland. Elefanterna är av hårdplast och finns i två storlekar; 11 cm och 28 cm.', 0),
