(25805, 'Gloria Silver small ', 'Storsäljaren Ljusstaken Gloria ifrån KLONG i mässing, har fått många fina utmärkelser. Nu finns den även i försilvrad mässing! \r\nMått: H 34cm x D 6cm', 160),
