(25807, 'Äng Silver Liten', 'KLONG. Vasen är tillverkad i försilvradmässing med tillhörande glasinsats, den utskurna metalställningen fungerar som ett inbyggt blomsterstöd. \r\n\r\nSkötselråd Äng: Mässingen är lackerad för att kunna klara av att vara i vatten men tänk på att torka bort växtsaft från mässingsytan. Låter man mässingsvasen stå för länge utan att byta ut blomvattnet kan växt saft/partiklar tränga in i mässingen och den kan då bli missfärgad. Diska insatsen med vatten och vanligt diskmedel, utan slipmedel. Har det kommit växtsafter i lacken så kan det vara svårt att få bort – det är därför viktigt att ni ser till att torka bort detta genast. Har det blivit fläckar som trängt sig in i lacken så är det bäst att först använda lacknafta  eller tinner ( för att ta bort lacken ) och sedan använda mässingsputs. Mässingen kräver då regelbunden underhållning.', 159),
(25808, 'Äng Silver Stor ', 'En underbar vas som vann utmärkelsen Årets Inredningsaccessoar i Elle Decoration Swedish Design Awards 2014. Designad av Eva Schildt för KLONG. Vasen är tillverkad i försilvradmässing med tillhörande glasinsats, den utskurna metalställningen fungerar som ett inbyggt blomsterstöd. \r\n\r\nSkötselråd Äng: Mässingen är lackerad för att kunna klara av att vara i vatten men tänk på att torka bort växtsaft från mässingsytan. Låter man mässingsvasen stå för länge utan att byta ut blomvattnet kan växt saft/partiklar tränga in i mässingen och den kan då bli missfärgad. Diska insatsen med vatten och vanligt diskmedel, utan slipmedel. Har det kommit växtsafter i lacken så kan det vara svårt att få bort – det är därför viktigt att ni ser till att torka bort detta genast. Har det blivit fläckar som trängt sig in i lacken så är det bäst att först använda lacknafta  eller tinner ( för att ta bort lacken ) och sedan använda mässingsputs. Mässingen kräver då regelbunden underhållning.\r\n\r\nVi rekommenderar Bistro koppar/mässingsputs.', 159),
(25810, 'Ljusstake Annulus Silver', 'En stilren ljusstake i storfritt stål med plats för fyra stycken kronljus. \r\n\r\nLåt aldrig ett ljus för att brinna hela vägen ner, eftersom värmen av lågan kan skada ljushållaren!', 160),
(25811, 'Ljusstake Anulo Mässing', 'Ljusstake Anulo - En klassisk ljusstake tillverkad i mässing avsedd för kronljus. Finns även som en adventsljusstake. \r\n\r\nLåt inte ljuset brinna ner helt, då det kan skada ljusstake. ', 160),
