(25913, 'Dear Lion 50x70', 'Dear Lion Det lilla lejonet fick vid ganska tidig ålder en stor svallande lejonman, massvis med guldglänsande hår som vågade sig i vinden. Eftersom hårsvall inte passar på en liten flicka tyckte flocken att hon var konstig och lämnade henne på den magiska cirkusens trapp. Nu är hon cirkusen konung och visar stolt och gladeligen upp sin stora glimrande frisyr. \r\n\r\nPostern är 50x70 cm och tryckt på 170g Munken Polar Rough matt papper för att bibehålla den fina känslan av originalet i akvarell. Limiterad upplaga, när den är slut är den slut för alltid. ', 256),
(25917, 'Mr Otis 40x50', 'Mr Otis var en övergiven pojke. Ingen hade någonsin sett hans föräldrar och ofta vaknade han utan tak över huvudet. Otis uppväxt hade kunnat bli en riktig sorglig historia om det inte vore för cirkusen. Den räddade hans liv. Eller egentligen inte så mycket cirkusen som plats utan vännerna, gemenskapen och upptäckten av att kunna använda sina förtrollade vingar. \r\n\r\nPostern är 40x50 cm och tryckt på 170g Munken Polar Rough matt papper för att bibehålla den fina känslan av originalet i akvarell. Limiterad upplaga, när den är slut är den slut för alltid. ', 256),
