(26016, 'City Trivet TOKYO', 'Skötselråd City Trivets\r\nRengör med en fuktig trasa och lite diskmedel. Ska ej blötläggas eller diskas i maskin. Karottunderlägg i metall är avsedda för varma kärl men undvik extremt hög temperatur då detta kan fördärva filttassarna.', 194),
