(26047, 'Ljusstake Kattvik Mässing ', 'Med vackert stormglas som gör att ljuset inte blåser ut och minimerar brandrisken. Stabil och smidig fot håller ljusstaken stående även i stark vind och tar liten plats på bordet.\r\nKan användas såväl inom – som utomhus i olika miljöer – året runt.', 0),
(26048, 'Ljusstake Kattvik förnicklad mässing', 'Med vackert stormglas som gör att ljuset inte blåser ut och minimerar brandrisken. Stabil och smidig fot håller ljusstaken stående även i stark vind och tar liten plats på bordet.\r\nKan användas såväl inom – som utomhus i olika miljöer – året runt.', 0),
(26049, 'Maison Mini Tin 3-pack ', 'Voluspa Classic Mini Tin Trio är en härlig uppsättning med tre stycken doftljus i metallbehållare med lock. De brinner med ren, klar låga och avger kraftfull, generös essens. \r\n\r\nInnehåller tre ljus i Crisp Champagne - Sprudlande champagne med inslag av vanilj och ekfat. Mandarino Cannela - Italiensk mandarin med en mix av vanilj, kanel, muskot och ingefära. Pomegranate Blood Orange - Moget granatäpple i mix med skal från blodapelsin, iskallt bubbel och klyftor av nektarin.\r\n\r\nBrinntid: 25 tim/per ljus. ', 0),
(26053, 'Carlos`s Places', 'DESCRIPTION\r\nCarlos Souza, Worldwide Brand Ambassador for Valentino, is constantly traveling. From New York to São Paolo to Shanghai, he shares a colorful guide to his favorite destinations overflowing with food, fashion, art, and life. Much more than simply an address book, #Carlos’s Places is framed by Souza’s personal experience and wanderlust, and offers an exclusive insider’s look at some of the world’s chicest cities, complete with recommendations for old favorites and new classics. #Carlos’s Places is an effervescent handbook for the seasoned globetrotter in search of a lively travel.', 94),
(26054, 'American Hotel Stories', 'DESCRIPTION\r\nFrom Big Sur to Boston, this enticing volume follows in the footsteps of Jim Morrison, Marilyn Monroe, Tennessee Williams, Al Capone, Clint Eastwood, Esther Williams, and some of America\'s most famous personalities and hotel guests. Which famous star stayed at the Biltmore in Coral Gables? Where did notorious Beat writer Jack Kerouac seek refuge? Which beloved entertainer still performs in the cafe of The Carlyle in Manhattan? Which folk singer produced an album and a child in the Hotel Chelsea? The myths, the mysteries, and the affairs unravel city by city in this captivating book by travel writer Francisca Matteoli. A comprehensive appendix guides you to a select list of the nation\'s most unique hotels to make your own story.', 77),
(26056, 'Gypset Style', 'DESCRIPTION\r\nGypsetters are artists, designers, and bon vivants who live and work around the globe. Wanderlust meets the height of sophistication as New York Times journalist Julia Chaplin explores the unconventional lives of these high-low cultural nomads and the bohemian enclaves they inhabit. In addition to Jade Jagger, Damien Hirst, and Alice Temperly, the Gypsetters\' counterculture forebears, including the Victorian explorers, the Lost Generation, the Beatniks, and the hippies, are all profiled.', 77),
(26057, 'Gypset Living', 'DESCRIPTION\r\nIn her third book in the Gypset series for Assouline, Julia Chaplin explores the living spaces of gypsy-jet-setters around the world, from Hydra to Gué,thary; from Cuixmala to Pa’ia, and beyond to the Indonesian isles. Chaplin, who coined the term gypset, provides an insightful look into these spectacular personal utopias with her witty and humorous stories of the gypsetters that she meets along the way, such as Alix Goldsmith Marcaccini at her Mexican hideaway, or Halemano, a kind of hippie Four Seasons in Hawaii. Stunning photography opens the door to the fascinating and dazzling homes and haunts of the bohemian artists, designers, and bons vivants known as the gypset.', 77),
(26058, 'Hotel Stories', 'DESCRIPTION\r\nRevealing the myths and mystery behind legendary hotels and their famous guests, Hotel Stories transports you to the most talked-about haunts across the globe. Greta Garbo was \"born\" in a Berlin palace; \"James Bond\" was created in a house in Jamaica; Al Capone lived his last days in a hotel in Miami; Frida Kahlo escaped with Leon Trotsky to a hacienda in the Mexican countryside. From Rome to Hong Kong, Nairobi, Chile, and Mexico, travel the world from your couch or use the detailed hotel guide provided to go see the rooms for yourself.', 77),
(26059, 'In The Spirit Of Bali', 'DESCRIPTION\r\nThe spiced aroma of frangipani, sweeping beaches, dramatic landscapes inhabited by beautiful people—these are the popular images of Bali, but the legendary island is also a magnet for celebrities, artists, and generations of intriguing eccentrics and intrepid explorers. Islands occupy a hallowed place in literature and mythology, and among islands Bali is the quintessence. Accepting the presence of the unseen spiritual universe is a hallmark of the island’s attitude.\r\n\r\nRecently popularized by the best-selling novel Eat, Pray, Love, Bali is currently experiencing a boom, sparking concerns and debates about maintaining the balance of the island’s ecosystem. In the Spirit of Bali explores the many facets of this mythical island, from its verdant topography, intricate colonial history, and deeply rooted traditions and rituals, to the recent influx of hard-partying holiday-makers, holistic enlightenment seekers, bohemian expat artists, and new age entrepreneurs.\r\n\r\nFeaturing beautiful original photography by Isabella Ginanneschi, In the Spirit of Bali includes a comprehensive guide to hotels, resorts, villas, restaurants, temples, yoga retreats and holistic resources, nightclubs, sightseeing, entertainment, and recreation.', 77),
(26060, 'In The Spirit Of Harlem', 'DESCRIPTION\r\nWith its incredible history, cultural richness, musical heritage, and renowned cuisine, Harlem is undoubtedly one of the most intoxicating New York City communities.\r\nIn this beautifully illustrated volume, author Naomi Fertitta takes readers on both a written and visual journey to pious churches, landmark architecture, sparkling clubs, vibrant theaters, and bustling restaurants. For native New Yorkers and visitors alike, In the Spirit of Harlem paints a colorful picture of one of America’s most fascinating neighborhoods.\r\nThe book includes a foreword by chef Marcus Samuelsson and a directory comprising Fertitta’s recommendations.', 77),
(26061, 'In The Spirit Of Miami Beach', 'DESCRIPTION\r\nWhat Venice was to the world during the Renaissance era, so Miami is to the world today. An active melting pot of cultures; where Art Deco contends with Spanish Baroque; where artists mingle with athletes, models, and socialites; where South Americans and Eastern Europeans sit together for espressos on Ocean Drive. This book explores Miami Beach style, from the mythical Lincoln Road to Art Basel Miami, one of the leading international art fairs. With an in-depth look at its historical past as well as its present-day glamour, In The Spirit of Miami Beach elegantly captures the city\'s vibrant personality and cultural jubilance. With an exuberant text by noted author, entertainer, and bon vivant David Leddick, this rich volume brings one of the world\'s hottest destinations to colorful life. The book concludes with a selective guide on the hotels, restaurants, bars, nightclubs, and spas to experience \"stylish Miami\".', 77),
(26063, 'In The Spirit Of New Orleans', 'DESCRIPTION\r\nNew Orleans—with its jazz music, Mardi Gras festivities, unique cuisine, and exquisite architecture—is one of the most intriguing American cities. In this celebratory volume, author Debra Shriver shares what makes the Crescent City so special, from its fascinating history to its rich musical legacy, to its enduring traditions and cultural landmarks. For natives and visitors alike, In the Spirit of New Orleans paints a complete picture of this alluring destination. An insider’s list featuring bars for the cocktail connoisseur, venues for the music maven, and can’t-miss restaurants for the gourmand completes the book. ', 77);
