(26064, 'The Luxury Collection Room With A View', 'DESCRIPTION\r\nLike a theatrical backdrop, a breathtaking view sets the stage for an uplifting journey of the spirit. Featuring a room or suite in each of The Luxury Collection’s more than ninety-five properties that frames an exceptional panorama, The Luxury Collection Room with a View showcases the world’s most beautiful and inspiring destinations. Notable tastemakers, including Valentino global brand ambassador Carlos Souza, art director Sofia Sanchez de Betak, and designer Margherita Missoni, reflect on their favorite views and relate their unforgettable travel experiences. From the pristine sands of Aegean Riviera in Bodrum, Turkey, to the bustle of San Francisco to the verdant Sacred Valley of Peru, at the base of Machu Picchu, this volume is a virtual adventure around the world that will leave readers dreaming of their next escape.\r\n\r\nThe Luxury Collection is an ensemble of more than ninety-five of the world’s finest hotels and resorts, each noteworthy for its architecture, art, furnishings, and amenities. Sharing a dedication to immaculate service and comfort, each property has a unique heritage inextricably tied to its destination. Curated for their spirit of diversity and genre, each Luxury Collection property has a story to tell.', 77),
(26065, 'Volez Voguez Voyagez', 'DESCRIPTION\r\nSince the company’s inception by its namesake founder more than 150 years ago and the creation of its universally recognized monogram in 1896, Louis Vuitton has expanded its borders to encompass everything from perfumes to handbags to ready-to-wear. But Louis Vuitton Malletier has always been rooted in the timeless spirit of travel. Based on the exhibition curated by Olivier Saillard at Paris’s Grand Palais, this album was created to accompany the show on its travels around the world, beginning in Japan in spring 2016. Louis Vuitton’s Volez, Voguez, Voyagez gives readers an understanding of the history and vision of the brand whose innovation made traveling effortless as well as fashionable.\r\n', 77),
(26066, 'Emilio Pucci', 'DESCRIPTION\r\nInspired by athletic wear and the bright flags used during horse races, Emilio Pucci designed unmistakable prints using combinations of bold colors and geometric shapes. Fashioned into silk jersey dresses that flattered the female figure, these light, versatile sheaths became all the rage among the international jet set of the \'60s. Pretty soon, Pucci prints appeared everywhere on shoes, purses, luggage, billfolds, bathing suits, nightgowns, bras, and underpants. Then, between 1960 and 1970, Pucci\'s designs underwent a transformation: previously reserved for an enthusiastic elite, they became a mass phenomenon. Through the use of new types of fabrics, Pucci helped liberate women from girdles and padding, ushering in an extraordinary chapter in modern culture.', 94),
(26067, 'In The Spirit Of Napa Valley', 'DESCRIPTION\r\nNapa Valley is known around the globe for its world-class wines, beautiful farmland and countryside, and envied lifestyle. Featuring a foreword by renowned chef Thomas Keller, In the Spirit of Napa surveys great local culinary establishments from exclusive restaurants to local farmers’ markets, legendary wine pioneers and cult labels, notable architectural landmarks from fantasy castles to historic family estates, plus art collections, music festivals, and natural mineral spas. This gorgeous volume concludes with a comprehensive guide to hotels, restaurants, wineries and tasting rooms, sightseeing, entertainment, and recreation.', 77),
(26068, 'In The Spirit Of Rio', 'DESCRIPTION\r\nRio de Janeiro is the “Cidade Maravilhosa” that greets everyone with friendly faces and open arms. Its magic begins with its natural beauty, which has amazed travelers since the first explorers landed in the sixteenth century and has inspired countless artists, designers, architects, poets, and musicians for more than 450 years. The massive statue of Christ the Redeemer on top of Corcovado mountain watches over the sea and the mountains, the concrete jungle and the world’s largest urban forest, the simple colonial facades of churches concealing rich baroque interiors, and the scantily clad bodies that parade the beaches, where all classes gather in the democracy of bikinis and sungas.\r\n\r\nBut the attraction of this unique place is even deeper; it lives in the hearts of its citizens, the cariocas, who, no matter where they go, radiate the sun they so revere. Generous, creative, open-minded, and in constant motion, they are a people of all colors and creeds, which, despite the difficulties of social and class divisions, never loses its morale, its smiles, and its faith in the victory over the daily battles of the human condition.\r\n\r\nEpicenter of the colorful explosion of joy, feathers, and sequins that is Carnaval, Rio is a marvelous gateway to discover the wonders of Brazil. Filled with vibrant imagery celebrating this dynamic city, In the Spirit of Rio includes a guide to the best hotels, restaurants, art galleries, shopping, and sightseeing attractions.', 77),
