(26649, 'Room Spray Ernesto', 'Rumsspray från Cire Trudon.  Ernesto - Cuir et Tabac -\r\n\r\nDoften bringar minnen av ett hotellrum i stekande sol i Havanna under revolutionen. Med toppnoter av rom, grapefrukt och bergamott, hjärtnoter av kryddnejlika, ek och patchouli och en bas av tobak, mossa och läder. Doftljuset är tillverkat av 100% vegetabiliskt vax med en veke av ren bomull. Ljuset biologiskt nedbrytbart, allergivänligt och innehåller inga bekämpningsmedel.\r\n\r\nToppnot: bergamott, grapefrukt och rom\r\nHjärtnot: ek, nejlika, patchouli\r\nBasnot: tobak, mossa, läder\r\n\r\nVikt: 375 ml', 286),
(26650, 'Before they pass away', 'In his landmark project Before They Pass Away Jimmy Nelson captures the lives and traditions of the last surviving tribes who have managed to preserve their traditional ways and customs within our increasingly globalized world. The British photographer’s epic portraits present these dignified inheritors of noble and age-old traditions in a proud spirit and in all their glory—a unique visual experience. This exquisitely photographed showcase for world tribal culture is not only a joy to look at, but also an important historical record. This book reveals the wide variety of human experiences and cultural expressions across the ages— and we’re delighted to have it among our fall offerings.\r\n\r\nCOLLECTORS EDITION XXL is a limited edition of 500 handsigned and numbered copies offered in a sumptuous clamshell box (460 x 630 mm), showcased on a custom-made transparent book holder and containing three autographed art prints of tribesmen.', 99),
(26658, 'Doftspridare Saijo Persimmon', 'Japansk persimon i kombination med röda vinbär och persika utgör en underbar gourmand doft. Primära dofter: Persika, Persimmon, Röda vinbär Doftfamilj: Fruktig. 14 cl.', 286),
