(26669, 'Ascot kombinationsljusstake hög', 'En ljusstake som går att kombinera och variera i all oändlighet. Det enkla snittet bidrar till den lekfullhet som var själva grundidén bakom denna produkt och bjuder in till kombinationer där endast fantasin sätter gränserna. Sätt ihop de höga och låga ljusstakarna och kombinera din egen favorit.', 0),
(26670, 'Ascot ljussläkare rött läder', 'En klassisk produkt med modern touch, skapades efter en tanke om att både form och materialval skulle vara bidragande i dess uttryck. De runda formerna och det läderlindade handtaget ger en traditionell produkt ett modernt snitt med en klassisk funktion. Tillverkad i gedigen mässing som ger ljussläckaren tyngd och förhöjer kvalitetskänslan ytterligare.', 292),
(26671, 'Ascot Ljusstake 4 kulor mässing', 'Med en formgivning som är unik, där den kvadratiska foten inbjuder till att kombinera ljusstaken i par bli detta en detalj som är ny för den svenska marknaden. Den höga ljusstaken ger ett elegant intryck och inbjuder till beundran, där ett hänförande hantverk och en gedigen formgivning ligger till grund.', 160),
