(27399, 'Dora Maar Condiment Bowl S', 'A clear glaze makes our Dora Maar Condiment Bowl fabulously functional for everything from dips to desserts.\r\n\r\nInspired by Dora Maar, the French photographer, poet, and painter best known for being a lover and muse of Pablo Picasso.\r\n\r\nJonathan throws the models for the Muse vessels and then substitutes our signature geometric relief patterns with body parts—faces, breasts, lips—to create a surreal style. Each piece is made from unglazed matte porcelain to accentuate the forms and is inspired by our favorite artists\' muses.', 162),
