(27514, 'Veuve Clicquot', 'Veuve Clicquot Ponsardin has been pushing boundaries since creating rose Champagne in 1775. Centuries later, the brand represents a complete lifestyle: Veuve Clicquot is the drink of choice in spring at Goodwood Circuit in the United Kingdom, in summer on the polo lawns of New York, and in winter on Carnival chariots in Rio. Partnerships with names like Ferrari, Andree Putman, the Campana Brothers, and Tom Dixon have led to limited-edition Champagnes and products from pillows and handbags to kitchenware and sports equipment. The house even uses eco-friendly packaging made from the pulp of Champagne region grapesÂ a global first. Fine, authentic products and classic culture are truly the keys to life Â a la Clicquot.\"', 77),
