(27587, 'Matta PET Bahar - Indigo/Ivory', 'Carpet PET Bahar Indigo/Ivory - En handvävd polyester matta ( PET ) . \r\nDenna mångsidiga matta kan användas både inomhus och utomhus . Handvävda från återvunna petflaskor, mattan har en mjuk känsla och latexbaksida som gör att den ligger stadigt mot underlaget/golvet. Lätt placeras i korridoren , kök , på balkongen eller terrassen. Finns i flera färger, Mått 80x50cm.\r\n\r\nSkötselråd Dammsug med låg effekt utan en visp borste . Ta bort fläckar omedelbart med fuktig trasa. Använd ej maskintvätt , blekmedel eller torktumlare. Vid professionell rengöring fungerar flatwash eller kemtvätt . Undvik exponering av vatten eller fukt under en längre tid på mattan. Om mattan utsätt för regn, rulla ihop den och ställ den upp så att vattnet lätt kan rinna av. ', 258),
