(27621, 'ABC poster ', 'ABC Den långa tunneln avslutas med en stor dörr med smideshandtag som liknar eklöv. Strax ovanför bladen finns en tavla med bokstäver. Alfabetet glänser och skiftar i färg. Den fråga som ställdes vid första passagen ska nu viskas i riktning mot den förtrollade tavlan. Om svaret är rätt öppnas den vänstra dörren och någon möter upp vid den hisnande avsatsen.', 269),
(27622, 'Mr Charlie', 'Mr Charlie Grönskans ö ger syre åt hela systemet. Här bor Charlie. Ön ligger längst bort från ingången till Landet i luften. Här blandas tropiska och arktiska väderförhållanden och man kan besöka alla olika årstiderna genom att vandra på de förtrollade stigarna. Charlie vet allt om hur man hittar på ön. ', 269),
(27626, 'Around The Glade Poster ', 'Around the Glade - Första tecknet att man är på väg i rätt riktning är den ljusa gläntan. Där vaktar rådjuret i ständigt sällskap av sanningsfåglarna. Det råder ingen tvekan om att rådjuret ser in i framtiden. Fast bara med några minuters försprång. Hon får en föraning om vilken fråga hon bör ställa men hinner aldrig varna ifall mötet skulle innebära någon fara för slutdestinationen. ', 269),
(27628, 'Dear Fawn Poster ', 'Dear Fawn - Varje år får den snabbaste löparen uppdraget att vara förbindelsen mellan den ljusa och den mörka gläntan. Vår unge vän, som utrustats med fyra ben, vingar och en knivskarp förmåga att ständigt fatta kloka beslut, färdas med ljusets hastighet på den långa och ständigt föränderliga sträckan mellan de två portarna.  ', 269),
(27630, 'Secret Tunnel Poster ', 'Secret Tunnel - Ingen lägger märke till den mörka gläntan om man inte är speciellt inbjuden. För de flesta förbipasserande går den obemärkt förbi. Men vid gläntans port sitter nyckelhållaren och hans djur. Dessa två bemannar gläntan dag och natt, utan sömn. Det finns otaliga nycklar som delas ut till de utvalda och när du väl har nyckeln i din hand är tunneln öppen. Förbi gläntan, genom tunneln, lås upp den vänstra dörren och nå fram till det makalösa Landet i luften.   ', 269),
(27631, 'Flying Sparrow Poster', 'Flying Sparrow - En av de viktigaste sakerna i den här världen är att finna en vän med vingar. För vissa tar detta många år och för andra är vännen där på en gång. Den ständiga följeslagaren ger möjligheten att färdas mellan de olika svävande öarna. På den första ön, där den stora ekens rotsystem syns tydligt och skymmer sikten av de bakomliggande öarna, på den här ön föds alla bevingade.  ', 269),
(27632, 'Byrå Sebago Svart', 'Byrå i massivt svart betsat amerikansk pinje\r\nDimensioner: B.125 cm D. 45 cm H. 100 cm\r\nMaterial: Massiv pinjeträd\r\nFärg: Svart (*distressed). Finns även i vit.\r\n\r\nNewport möbler\r\nThe Colored Pine Collection från Newport tillverkas i Europa av pinjeträd. De svartlackade möblerna är mycket omtyckta och är tillverkade för att hålla i flera generationer. En klassisk möbelserie där produktionen sker hantverksmässigt i egen regi med högsta kvalitet, materialval och omsorg. *Distressed är en metod som används för att uppnå ett lätt åldrat men elegant utseende (patina). Resultatet uppnås genom lätt slipning av hörn och kanter.', 89),
(27633, 'Byrå Sebago White', 'Byrå i massivt svart betsat amerikansk pinje\r\nDimensioner: B.125 cm D. 45 cm H. 100 cm\r\nMaterial: Massiv pinjeträd\r\nFärg: Vit. Finns även i svart.\r\n\r\nThe Colored Pine Collection från Newport tillverkas i Europa av pinjeträd. De svartlackade möblerna är mycket omtyckta och är tillverkade för att hålla i flera generationer. En klassisk möbelserie där produktionen sker hantverksmässigt i egen regi med högsta kvalitet, materialval och omsorg.\r\n*Distressed är en metod som används för att uppnå ett lätt åldrat men elegant utseende (patina). Resultatet uppnås genom lätt slipning av hörn och kanter.', 89),
(27634, 'ASSONET', 'Vitrinskåp i svartlackerad pinjeträd\r\nDimensioner  B. 188 cm D. 45 cm H. 234 cm\r\nMaterial: Pinje\r\nFärg: Black\r\n\r\nNewport möbler\r\nThe Colored Pine Collection från Newport tillverkas i Europa av pinjeträd. De svartlackade möblerna är mycket omtyckta och är tillverkade för att hålla i flera generationer. En klassisk möbelserie där produktionen sker hantverksmässigt i egen regi med högsta kvalitet, materialval och omsorg.\r\n*Distressed är en metod som används för att uppnå ett lätt åldrat (patina) men elegant utseende. Det åldrade resultatet uppnås genom lätt slipning av hörn och kanter.', 435),
(27635, 'Vitrinskåp Assonet White', 'Vitrinskåp i vitlackerad pinjeträd\r\nDimensioner  B. 188 cm D. 45 cm H. 234 cm\r\nMaterial: Pinje\r\nFärg: White \r\n\r\nNewport möbler\r\nThe Colored Pine Collection från Newport tillverkas i Europa av pinjeträd. De svartlackade möblerna är mycket omtyckta och är tillverkade för att hålla i flera generationer. En klassisk möbelserie där produktionen sker hantverksmässigt i egen regi med högsta kvalitet, materialval och omsorg.\r\n*Distressed är en metod som används för att uppnå ett lätt åldrat (patina) men elegant utseende. Det åldrade resultatet uppnås genom lätt slipning av hörn och kanter.?', 435),
