(28017, 'Champagne/Wine cooler', 'En perfekt champagne & vinkyl för heta sommar dagar eller kyliga vinter kvällar vid den sprakande öppna spisen. Tillverkad av polerad mässing med insats i aluminium. Luftspalten som bildas mellan insatsen i aluminium och höljet bibehåller kylan och håller vinet iskallt. ', 183),
(28021, 'Lunar, candleholder, large, silver', 'The London Collection är designad av den internationellt kända smyckesdesignern Lara Bohinc. - Jag är fascinerad av Sverige och Skandinavien. Att arbeta med ett företag som Skultuna som står för tradition, kvalitet och tidlös design går hand i hand med min design och mina visioner, säger Lara Bohinc. Lara Bohinc är mest känd för sitt eleganta och tidlösa formspråk på smycken. Inspirationen till The London Collection kommer från resor; linjerna i mönstret Lunar är inspirerade av motorvägarna i Japan, Celestial är inspirerad av planeternas rörelser runt solen och Feather av fåglarnas lätta vingslag. ', 160),
