(28156, 'Trombone Cocktail Shaker, försilvrad', 'Story Behind the Design\r\n\r\nInspired by the beauty and detail of brass instruments and the sounds and atmosphere at Ronnie Scott\'s jazz club in London, Nick\'s Trombone bar accessories are super, swish, stylish and seductive. They are also highly practical, designed to last and beautifully finished in mirror polished 18/10 stainless steel.', 181),
(28157, 'Spheres Tekanna försilvrad, stor', 'Story Behind the Design\r\n\r\nA long time ago I visited a tea warehouse where they had a myriad of loose tea in boxes from all over the world. That got me thinking about where tea comes from and all the different types of leaves and flavours that are produced. The Spheres infusers were therefore inspired by the idea of tea leaves from around the world and I designed the infuser basket to work with all types of loose leaf flavours.', 195),
(28158, 'Spheres Tekanna försilvrad, liten', 'Story Behind the Design\r\n\r\nA long time ago I visited a tea warehouse where they had a myriad of loose tea in boxes from all over the world. That got me thinking about where tea comes from and all the different types of leaves and flavours that are produced. The Spheres infusers were therefore inspired by the idea of tea leaves from around the world and I designed the infuser basket to work with all types of loose leaf flavours.', 195),
(28159, 'Queen\'s tekula, försilvrad', 'Queen’s Tea Ball tea infuser made from 18/10 polished stainless steel. It has a hinge mechanism to open and close the basket which is sealed by a gold crown that sits on top. At the bottom, there is a small foot plate which allows the product to stand majestically in-between cups of tea!', 195),
