(28180, 'IBIZA BOHEMIA ', 'Since its discovery as a desirable destination in the 1930s, Ibiza has been an escape: for artists and intellectuals fleeing oppression, Hollywood stars seeking privacy, hippies during the Summer of Love, and eighties rock stars like Pink Floyd and Freddie Mercury. Today, many come for the explosive house music scene, which thrives in clubs like Pacha and Amnesia; others prefer the peaceful yoga retreats. For decades, Joni Mitchell, Kate Moss, David Bowie, Jade Jagger, Jean Paul Gaultier, and countless other creative minds have explored and enjoyed this hippie-chic atmosphere, the perfect backdrop for artistic freedom, spiritual soul, and international glamour.\r\n\r\nRenu Kashyap is a fashion stylist and editor whose chic and feminine aesthetic has made her a favorite with such magazinesas Glamour Netherlands. Following years of shooting in far-flung locations, she relocated to Ibiza from Amsterdam with herhusband, Bas, and daughter, Skye Avelon, in 2012. Passionate about timeless, iconic fashion photography, Renu is now apartner at Caramba Productions, an Ibiza-based company that produces high-fashion editorials for international editions ofVogue and advertising campaigns for the world\'s biggest names. Maya Boyd is a travel writer whose work appears in titles including Conde Nast Traveller, Elle, and The Guardian. She is also thefounder of the cultural and historical forum Ibiza Insights. Maya\'s father lived in Ibiza during the late 1960s, and she spent endlesssummer holidays on the island before moving there in 2009. Maya lives with her husband, James, and two small sons, Cassiusand Balthazar. Her heart lives in Formentera.', 0),
