(28516, 'MERE Fåtölj fudge', 'Nätt fåtölj med låg sitthöjd i Fudge läder \r\nMått: w 62 x d 76cx x h 80 x sh 46 cm\r\n\r\nLäder Fudge är ett täckfärgat fullnarvsläder, där skinnets ursprungliga yta har behållits för att den riktiga och äkta känslan hos skinnet ska framhävas så mycket som möjligt. Äkta läder är en naturlig produkt som kommer bära kännetecken om dess ursprung. På den naturliga ytan hos lädret  kan märken eller färgskiftningar uppstå genom slitage eller kontakt med bältesspännen eller nitar på till exempel jeans. Detta är normalt och berikar lädrets karaktär och personlighet med tiden. Läder  slits in, inte ut, och blir vackrare med åren.', 363),
