(28762, 'Mr Bill Poster ', 'Bill har vant sig vid att bo på ett bortglömt ställe. Uppdraget är viktigare än hans plats. Hans öde bestämdes långt före han föddes och kanske är det därför han aldrig ifrågasatt det. Hans gåva är att se in i en tänkbar framtid vilket gör honom till den bästa beslutsfattaren. Vännerna brukar skoja om att han kommer från en annan tid, och kanske är det precis vad han gör.', 256),
