(28833, 'Vimpel - Bill & The Balloons', 'Mr Bill bor i Minimighettos lilla värld. Eller egentligen är den inte så liten. Den bara är. Så kan man bäst sammanfatta den. Världen alltså. Den har spridit sig till olika hörn och infiltrerat mänskligheten på ett näst intill osynligt sätt. Så är också filurerna som bor i den. Vissa tar plats, vissa lever i stillhet. Vissa är stora, andra är små och några arter är pyttepytte. De är väldigt mänskliga, fast ändå inte. De besitter krafter som ingen av oss behärskar. Deras gåvor sträcker sig från stark magi till små finurliga förmågor.', 256),
(28834, 'Vimpel - Frankie & The Unicorns', 'Miss Frankie bor i Minimighettos lilla värld. Eller egentligen är den inte så liten. Den bara är. Så kan man bäst sammanfatta den. Världen alltså. Den har spridit sig till olika hörn och infiltrerat mänskligheten på ett näst intill osynligt sätt. Så är också filurerna som bor i den. Vissa tar plats, vissa lever i stillhet. Vissa är stora, andra är små och några arter är pyttepytte. De är väldigt mänskliga, fast ändå inte. De besitter krafter som ingen av oss behärskar. Deras gåvor sträcker sig från stark magi till små finurliga förmågor.', 256),
(28835, 'Wall Friend -  Miss Astrid ', 'Astrid har den osynliga förmågan att skapa och sprida fantasi. Ju mer och ju högre hon gungar desto längre når hennes kraft. Inför Astrids ögon ser den flödande fantasin ut som stjärnor. Små glittrande stjärnor. Men alla kan inte se stjärnorna. Fantasin behövs och hjälper till att lära nya saker då de vanliga sinnena inte räcker till. Astrid vet att hon aldrig får sluta gunga för det behövs mycket fantasi för att framkalla magiska världar.\r\n', 256),
(28836, 'Wall Friend - Flying Sparrow ', 'En av de viktigaste sakerna i den här världen är att finna en vän med vingar. För vissa tar detta många år och för andra är vännen där på en gång. Den ständiga följeslagaren ger möjligheten att färdas mellan de olika svävande öarna. På den första ön, där den stora ekens rotsystem syns tydligt och skymmer sikten av de bakomliggande öarna, på den här ön föds alla bevingade...\r\n', 256),
(28837, 'The Equestrian World ', 'The Equestrian World takes you on a journey into a world where there is always the scent of polished leather and fresh hay in the air. Peek behind the scenes at world-famous competitions-from heart-pounding head-to-head races and hard-hitting polo matches to exquisitely-controlled dressage riding. Horse expert and aficionado, Peter Clotten, takes the reins in this book and whisks us into the many sides of the equestrian sport world.', 96),
