(28885, 'Memo Giant, Friends ', 'Från 3 år\r\nKlassiskt minnesspel för de allra minsta. I stort format, varje kort är 10 x 10 cm gör det lätt för alla små händer att vända korten. Spelkorten har fina djurmotiv. \r\n\r\nFörpackningsstorlek: 17 x 17 x 17 cm', 243),
(28887, 'Fancy Flamingo', 'Från +0 månader\r\nDenna skönhet är lång och ståtlig med sina 34 cm. Välklädd med tjusig tutu-kjol, och fina ballerinaskor och krona i silver. En mycket stilfull dansare. Tillverkad i polyester. Handtvätt vid behov. \r\n\r\nStorlek: 34 cm', 239),
(28889, 'Bashful Cream Bunny Booties', 'Bedårande söta skor för småttingarna. Skorna ser ut som små söta kaniner och är cremefärgade (vaniljgula). Supercharmiga skor för de allra minsta.\r\n\r\nStorlek: 10 cm\r\n0-6 månader ', 0),
(28890, 'Kite Ceiling Textile lamp', 'Från +0 månader\r\nEn urläcker lampa gjord i textil. Lampan är gjord för taket. Den häftiga draken är benvit och har 5 bomullsrosetter i olika milda färger som man fäster på drakens svans. Lampan blir ett riktigt blickfång i barnrummet.\r\n\r\nStorlek: 52 x 40 cm', 145),
(28897, 'Paraplyställ Mörkblå ', 'Paraplyställ i mörkblå med antikguld mönster ', 158),
(28898, 'Halvmånebord Durham Svart', 'Ett elegant halvmånebord tillverkat i svart metall med en toppskiva av klarglas. Dess mjuka och netta former gör möbeln enkel att möblera. Passar fint i både hall och vardagsrum. ', 240),
