(28933, 'Flasköppnare - Open sesame ', 'Känd som författaren till \"Brev till samhället\" är Eric Ericson också verksam som konstnär och formgivare. Eric Ericsons öppnare för Skultuna heter Open Sesame (efter Ali Babas magiska fras som öppnar grottan till skatten) och är gjord av polerad sandgjuten mässing. Formgiven 2017.', 192),
(28934, 'The Factory  Ljushållare ', 'The Factory är en liten etsad ljushållare för värmeljus inspirerad av de gamla fabriksbyggnaderna på bruket i Skultuna och bränderna som har förstört dem många gånger. Byggnaderna var ursprungligen byggdes i början 1600-talet. De nuvarande fabriksbygggnaderna byggdes efter en stor brand i slutet av 1800-talet. Formgiven år 2015.', 160),
