(28956, 'Gnistskydd Autun', 'Stadigt och praktiskt gnistskydd i en stilfull design. Väldigt dekorativt och fint som inredningsdetalj och tillför en mysig känsla i det rum den placeras i. Gallret tar emot gnistor från braskaminen och håller håller både barn och husdjur på avstånd. \r\n\r\nMått: 60x13x66cm ', 164),
