(28981, 'Bonbon mini vas', 'Trogen de historiska produktionsmetoderna på Skultuna tog Monica Förster och hennes designstudio fram Bonbon, en serie med tre olika minivaser. Bonbon är tillverkad genom trycksvarvning, en klassisk produktionsmetod som har använts under lång tid i Skultuna och som gör det möjligt att göra stora runda tredimensionella objekt ur plåt. Formgiven år 2016.', 159),
(28982, 'Bonbon mini vas medium ', 'Trogen de historiska produktionsmetoderna på Skultuna tog Monica Förster och hennes designstudio fram Bonbon, en serie med tre olika minivaser. Bonbon är tillverkad genom trycksvarvning, en klassisk produktionsmetod som har använts under lång tid i Skultuna och som gör det möjligt att göra stora runda tredimensionella objekt ur plåt. Formgiven år 2016.', 159),
(28983, 'Bonbon mini vas låg ', 'Trogen de historiska produktionsmetoderna på Skultuna tog Monica Förster och hennes designstudio fram Bonbon, en serie med tre olika minivaser. Bonbon är tillverkad genom trycksvarvning, en klassisk produktionsmetod som har använts under lång tid i Skultuna och som gör det möjligt att göra stora runda tredimensionella objekt ur plåt. Formgiven år 2016.', 159),
(28984, 'Plamen - ljusstake Mässing ', 'Plamen is a unique candelabra due to its ‘snuffer’, the accessory for extinguishing the flame.  The snuffer is designed as a cap which closes the object when there is no candle.  Its elegant handle mimics the wick of a candle.  When lit, the snuffer rests on the base, after extinguishing the flame it rests on the candle as a jewel hiding the burnt wick until next use.  Available in polished brass and stainless steel.', 160),
(28985, 'Brera Spegel', 'Den italienska formgivaren och designern Paolo Dell\'Elce har i samarbete med Skultuna formgivit Brera spegeln. Idén och uppkomsten kring Brera spegelns utseende härrör från detaljerna i den eklektiska arkitekturen i och kring Milano. I synnerhet med inspiration från fönsterdetaljer hämtade från katedralen Santa Maria del Carmine som ligger i Brera-distriktet, Milano. Spegelglaset och den högpolerade böjda mässingsramen samverkar och skapar ett attraktivt och harmoniskt spel av ljus och refkletioner på ett sofistikerat sätt. Designad 2016', 271),
(28986, 'Kin Ljuslykta Mullvadsgrå 5-pack', 'Kin ljuslyktor från Skultuna, formgiven av Claesson Koivisto Rune. Fem moderna och stilrena ljuslyktor för värmeljus i fem olika modeller. Fint att ha i grupp eller var för sig. Levereras i ett fint etui.\r\n\r\nDiameter:4 cm \r\nHöjd:4,5 cm', 160),
(28987, 'Via Fondazza Modell A', 'Vasserien Via Fondazza är formgiven av den italienska designern Paolo Dell\'Elce. Inspirationen kommer från de arketypiska former som finns representerade i stillebenmålningar av den italienska konstnären Giorgio Morandi vars arbete baserades på en grundlig forskning i balansen mellan form och proportioner. Via Fondazza är namnet på gatan i Bologna där konstnären hus och ateljé var belägna. Formgiven år 2014.', 159),
(28988, 'Vas Via Fondazza Modell B ', 'Vasserien Via Fondazza är formgiven av den italienska designern Paolo Dell\'Elce. Inspirationen kommer från de arketypiska former som finns representerade i stillebenmålningar av den italienska konstnären Giorgio Morandi vars arbete baserades på en grundlig forskning i balansen mellan form och proportioner. Via Fondazza är namnet på gatan i Bologna där konstnären hus och ateljé var belägna. Formgiven år 2014.', 159),
(28989, 'Vas Via Fondazza modell C', 'Vasserien Via Fondazza är formgiven av den italienska designern Paolo Dell\'Elce. Inspirationen kommer från de arketypiska former som finns representerade i stillebenmålningar av den italienska konstnären Giorgio Morandi vars arbete baserades på en grundlig forskning i balansen mellan form och proportioner. Via Fondazza är namnet på gatan i Bologna där konstnären hus och ateljé var belägna. Formgiven år 2014.', 159),
(28991, 'Kin Ljuslykta Azure 3-pack ', 'Kin är en serie ljushållare designade av den internationellt framgångsrika designerstudion Claesson Koivisto Rune, denna modell har en målad utsida, insidan är i blankpolarad mässing. Formgiven år 2010.', 160),
(28992, 'Vas Boule Liten Silver ', 'Den fransk-tyska designern Olivia Herms har arbetat både för den världsberömda designern Konstantin Grcic och för den Stockholmsbaserade designstudion Claesson Koivisto Rune. Olivia Herms har nu börjat utveckla sina egna produkter. Boule vaserna är hennes andra produkt för Skultuna.\r\n \r\nOlivia Herms om Boule; Vaserna som heter Boule (”sfär\" på franska) förkroppsligar den mest grundläggande formen av \"behållare \" - den runda skålen. Den nästan perfekta sfären övergår i en krage som håller blommorna. De tre storlekarna på Boule rymmer olika former och storlekar på buketter. Formgiven år 2015.', 159),
(28993, 'Vas Boule mini ', 'Den fransk-tyska designern Olivia Herms har arbetat både för den världsberömda designern Konstantin Grcic och för den Stockholmsbaserade designstudion Claesson Koivisto Rune. Olivia Herms har nu börjat utveckla sina egna produkter. Boule vaserna är hennes andra produkt för Skultuna.\r\n \r\nOlivia Herms om Boule; Vaserna som heter Boule (”sfär\" på franska) förkroppsligar den mest grundläggande formen av \"behållare \" - den runda skålen. Den nästan perfekta sfären övergår i en krage som håller blommorna. De tre olika storlekarna på Boule rymmer olika former och storlekar på buketter. Formgiven år 2016.', 159),
(28995, 'Vas Boule Mini Silver ', 'Den fransk-tyska designern Olivia Herms har arbetat både för den världsberömda designern Konstantin Grcic och för den Stockholmsbaserade designstudion Claesson Koivisto Rune. Olivia Herms har nu börjat utveckla sina egna produkter. Boule vaserna är hennes andra produkt för Skultuna.\r\n \r\nOlivia Herms om Boule; Vaserna som heter Boule (”sfär\" på franska) förkroppsligar den mest grundläggande formen av \"behållare \" - den runda skålen. Den nästan perfekta sfären övergår i en krage som håller blommorna. De tre olika storlekarna på Boule rymmer olika former och storlekar på buketter. Formgiven år 2016.', 159),
(28997, 'Aspen Brown Bear Throw ', '', 441),
(28999, 'Fat Claw', 'The Claw Series design Maria Nilsdotter. Smyckesdesignern Maria Nilsdotter är utbildad vid Central Saint Martins i London, hon driver sedan 9 år sitt eget varumärke med egen butik på Stureplan i Stockholm. Maria Nilsdotter har gjort sig känd för sin kompromisslösa, strama och samtidigt lyxigt punkiga formgivning som står för något helt nytt för Skultuna. Maria Nilsdotter om samarbetet; ”Det kändes spännande att låta Skultunas värld möta min. Jag tycker vi har många gemensamma värden som vikten av kvalité och material men samtidigt intressant att använda sig av kontrasterna mellan varumärkena också. Jag är väldigt glad över resultatet som känns både tidlöst, klassiskt och punkigt.” Formgiven år 2015.', 162),
