(29014, 'Äng Mega Blågrön ', 'En underbar vas som vann utmärkelsen Årets Inredningsaccessoar i Elle Decoration Swedish Design Awards 2014. Designad av Eva Schildt för KLONG. Vasen är tillverkad i mässing med tillhörande glasinsats, den utskurna metalställningen fungerar som ett inbyggt blomsterstöd. \r\n\r\nSkötselråd Äng: Mässingen är lackerad för att kunna klara av att vara i vatten men tänk på att torka bort växtsaft från mässingsytan. Låter man mässingsvasen stå för länge utan att byta ut blomvattnet kan växt saft/partiklar tränga in i mässingen och den kan då bli missfärgad. Diska insatsen med vatten och vanligt diskmedel, utan slipmedel. Har det kommit växtsafter i lacken så kan det vara svårt att få bort – det är därför viktigt att ni ser till att torka bort detta genast. Har det blivit fläckar som trängt sig in i lacken så är det bäst att först använda lacknafta  eller tinner ( för att ta bort lacken ) och sedan använda mässingsputs. Mässingen kräver då regelbunden underhållning.\r\n\r\nVi rekommenderar Bistro koppar/mässingsputs.', 159),
(29016, 'Äng Mega Mässing ', 'En underbar vas som vann utmärkelsen Årets Inredningsaccessoar i Elle Decoration Swedish Design Awards 2014. Designad av Eva Schildt för KLONG. Vasen är tillverkad i mässing med tillhörande glasinsats, den utskurna metalställningen fungerar som ett inbyggt blomsterstöd. Skötselråd Äng: Mässingen är lackerad för att kunna klara av att vara i vatten men tänk på att torka bort växtsaft från mässingsytan. Låter man mässingsvasen stå för länge utan att byta ut blomvattnet kan växt saft/partiklar tränga in i mässingen och den kan då bli missfärgad. Diska insatsen med vatten och vanligt diskmedel, utan slipmedel. Har det kommit växtsafter i lacken så kan det vara svårt att få bort – det är därför viktigt att ni ser till att torka bort detta genast. Har det blivit fläckar som trängt sig in i lacken så är det bäst att först använda lacknafta eller tinner ( för att ta bort lacken ) och sedan använda mässingsputs. Mässingen kräver då regelbunden underhållning. Vi rekommenderar Bistro koppar/mässingsputs.', 159),
(29017, 'Orb Vas Stor', 'Orb är en vas som har fått sin inspiration från atmosfären kring jorden. Glaskupolen blir ett skydd men samtidigt så hjälper det till att framhäva innehållet i den. Glaskupolen är tillverkat av munblåst glas och foten av mässning.', 159),
