(29695, 'Empress Reading Glass', 'Empress förstoringsglas \r\nHöjd:20,5 cm\r\nBredd:8 cm\r\nLängd:23,5 cm', 466),
(29720, 'Tornado Jetfighter ', 'TODAY, MORE THAN 40 YEARS AFTER ITS FIRST FLIGHT, THE VERSATILE TORNADO REMAINS ONE OF THE LEADING MILITARY AIRCRAFT IN WESTERN EUROPE.  ITS VARIABLE WING ANGLE AND ITS THRUST REVERSER-EQUIPPED ENGINES ALLOW THE TORNADO TO EXCEL IN HIGH-SPEED, LOW-ALTITUDE MANEUVERS, AND SHORT RUNWAY TAKE-OFFS AND LANDINGS. OUR TORNADO IS A DETAILED REPLICA OF ORIGINAL FACTORY SUPPLIED MODELS GRACING THE DESKS OF TOP MILITARY BRASS AND WAR OFFICES. A HISTORICAL PLAQUE IS INCLUDED. ', 461),
(29722, 'WWII Mustang', 'THE P51 MUSTANG WAS THE FIRST US BUILT FIGHTER IN ACTION AFTER THE FALL OF FRANCE, SUCCESSFULLY ENGAGING EVERY AIR-BORN OPPONENT FROM EARLY JUNKERS TO THE MESSERSCHMITT. FAST, POWERFUL AND MANEUVERABLE, WITH 75 GALLON TANKS UNDER EACH WING, ITS ABILITY TO FLY 6-HOUR MISSIONS WAS UNHEARD OF AT THE TIME. IN 1944 THE TRUMAN SENATE WAR INVESTIGATING COMMITTEE GAVE THE MUSTANG ITS HIGHEST RATING AS “THE MOST AERODYNAMICALLY PERFECT PURSUIT PLANE IN EXISTENCE”.\r\n\r\nTHIS DETAILED SCALE MODEL FEATURES A FULLY DETAILED COCKPIT WITH SLIDING COVER AND RETRACTABLE MAIN WHEELS. A DECORATIVE STAND (US/EU ONLY) AND A UNIQUE HISTORICAL PLAQUE ARE INCLUDED. Dimensioner: 66 X 75 X 25CM', 461),
(29723, 'Spitfire Travel Model', 'Spitfire Travel Model airplane', 292),
(29725, 'Art Deco Flight Clock', 'AN EXACT REPRODUCTION OF A 1930S ART DECO FLIGHT CLOCK. HAND CAST AIRPLANE ALUMINUM, POLISHED. NOSTALGIC AND CHIC. Dimensioner: 35.6 X 7.1 X 10.4CM', 461),
(29728, '1930s DC-3', 'NOSTALGIC AND PERFECT REPLICA OF AN EARLY TRAVEL AGENT ADVERTISING SIGN.\r\nDimensioner: 50 X 51.6 X 30CM', 461),
(29729, 'Propeller Klocka', 'DURING THE GREAT WAR, FROM 1914-18, A NEW KIND OF ART FLOURISHED. HAND CRAFTED CREATIONS FROM GIFTED SOLDIERS AND ARMY PERSONNEL BECAME KNOWN AS TRENCH ART. THEY USED WHATEVER MATERIAL WAS AT HAND?BULLET SHELLS, WOOD, AND FABRIC, DURING AN ERA WHEN PLANES WERE BUILT FROM FABRIC ON A FRAME. POPULAR FABRICATIONS INCLUDED LIGHTERS AND CLOCKS MADE IN ALL SHAPES AND SIZES. OUR ALUMINUM PROPELLER CLOCK WAS PROBABLY DESIGNED BY AN AIRPLANE ENGINEER AT A TIME WHEN ALUMINUM WAS ONLY USED FOR ENGINES AND SMALL PARTS. A BASE WITH AN ART-DECO FEEL SETS OFF A TRULY CHARMING LITTLE CLOCK WITH A SENSE OF HISTORY. BATTERY INCLUDED. Dimensioner: 5.6 X 30.5 X 9.4CM', 461),
(29730, 'Concorde', 'ONE OF THE MOST ICONIC AND BEAUTIFUL PLANES EVER DESIGNED. A FLIGHT ICON AND ENGINEERING MARVEL. THE ONLY SUPERSONIC PASSENGER AIRCRAFT EVER MADE. LONDON-NEW YORK IN 3 HOURS. ITS SLEEK AND ELEGANT SHAPE DEFINED A NEW ERA. GLAMOROUS AND POSH, ONLY THE FINEST WINES AND FOOD WERE SERVED. OUR DESKTOP PLANE IS RECREATED FROM ORIGINAL MODELS DISPLAYED AT THE TOP TRAVEL AGENTS OF BRITISH AIRWAYS AND AIR FRANCE. ENJOY A MEMENTO FROM THE HISTORY OF LUXURY TRAVEL. Dimensioner: 46 X 17.5 X 21.1CM', 461),
(29747, 'Zeppelin, 1937', 'FABRIC STRETCHED OVER LIGHTWEIGHT FRAME. HAND BUILT, 600 GLUED JOINTS. DRAMATIC AND HISTORICAL. GOLDEN AGE OF TRAVEL.\r\n\r\nDimensioner: 112.5 X 23.1 X 22.1CM', 461),
(29748, 'Zeppelin \'Hindenburg\'', 'AN OVERSIZED MODEL OF AN OVERSIZED CRAFT. SEE ITS DETAILS: ENGINE PODS, BRIDGE, WINDOWS, MARKINGS, TAUT FABRIC STRETCHED OVER FRAME.\r\n\r\nDimensioner: 165.1 X 34 X 36.1CM', 461),
(29749, 'Fokker Triplane ', 'DESKTOP MODEL OF THE LEGENDARY RED BARON?S OWN PLANE. DECKED OUT IN TRADEMARK RED, ALL DETAILS. ICONS OF EARLY FLIGHT.\r\n\r\nDimensioner: 38.6 X 47 X 19.1CM.', 461),
(29750, 'Sopwith Camel, Small', 'INCREDIBLY DETAILED DESKTOP SOPWITH CAMEL. SPOKE WIRE WHEELS, ROTARY ENGINE, LAMINATED PROPELLER, WWI LIVERY. Dimensioner: 25.9 X 38.1 X 12.4CM', 461),
(29751, 'Spirit of Saint-Louis', 'Spirit of Saint-Louis flygplan är en miniatyrmodell av det flygplan som Charles Lindberg flög i över Atlanten. Kika genom fönstret och att se den detaljerade cockpiten. \r\n\r\nVikt: 0,3kg\r\nMått: 31,1x49,5x8,9cm', 292),
(29752, 'Flying Circus Jenny, Medium', 'JENNIES CONQUERED THE NATION AFTER THE CLOSE OF WWI. STUNTS, SIGHTSEEING BY THE HALF HOUR, POSTAL, EVEN CIRCUS FLIGHTS TAKING OFF? TRUE MINIATURES OF EARLY FLIGHT HAVE NEVER BEEN OFFERED IN SUCH AN UPSCALE SERIES. Dimensioner: 51.1 X 80 X 18CM', 461),
(29753, 'Jenny JN-7H Classic Medium', 'IN BRILLIANT YELLOW AND BLUE US ARMY COLORS, NOW SOARING THE LIVING ROOM SKIES. HISTORIC FLIGHT IN MINIATURE.\r\n\r\nDimensioner: 51.1 X 80 X 18CM', 461),
(29755, 'Spad XIII', 'ANOTHER ALLIED WWI SPAD. NICKNAMED VIEUX CHARLES, IT IS A TRUE MINIATURE REPLICA OF GUYNEMER?S PLANE, STILL REVERED IN FRANCE TODAY.\r\n\r\nDimensioner: 59.9 X 75.9 X 23.1CM', 461),
(29756, 'Spad XIII French', 'Spad XIII en fransk flygplansmodell som flögs av stridsflygaren Guynemers under första världskriget som befann sig högt upp i vyerna och hade smeknamnet Vieux Charles. \r\n\r\nMått: 59,9x75,9x23,1cm', 292),
(29757, 'Transparent Spad ', 'MY GUESS IS THAT THIS PLANE WILL NOT FLY IN ANY PLANE COLLECTOR?S HOME. BOTH YOU AND I KNOW THAT MODEL PLANE COLLECTORS ARE HARD TO FIND AND EVEN HARDER TO PLEASE. OUR TRANSPARENT MODEL WILL SELL TO PEOPLE WHO WANT AN INTERESTING, INTRICATE PIECE OF HOME DÉCOR. THAT IS IN THIS CASE, A PLANE. THERE ARE SIMPLY NOT MANY THINGS YOU CAN HANG AS DÉCOR. SURE? A CHANDELIER? A MOBILE?. BUT A STRIKING OBJECT, BEAUTIFULLY MADE, SHOWING A WEB-LIKE CONSTRUCTION IN DETAIL? THEY?RE FAR AND FEW BETWEEN AND HARD TO FIND. THIS PLANE WILL FLY OUT THE DOOR! Dimensioner: 59.9 X 75.9 X 23.1CM', 461),
(29758, 'Dixie Clipper', 'IT’S 1939. PANAM RECEIVES THE FIRST BOEING 314, THE ULTIMATE IN LUXURY AIRCRAFT. COMPLETE WITH SLEEPING BERTHS AND A REAL DINING SALON. IT WAS THE BIGGEST PLANE OF ITS TIME, CARRYING 74 PASSENGERS. THE BIG FLYING BOATS WERE REPLACED AFTER THE WAR BY LAND-BASED PLANES. WITH THEIR DEMISE AN ERA OF ELEGANCE PASSED THAT WAS NEVER SEEN AGAIN. 152 FT WINGSPAN. FIVE DAYS, SIXTY HOURS IN THE AIR SFO-HK. WHEN FLYING WAS STILL FUN? METALLIC FABRIC COVERED LIGHTWEIGHT WING AND FUSELAGE FRAMES. TRANSPARENT PORTHOLES. DETAILED ENGINES. NOSTALGIC PANAM COLORS. INCREDIBLE DETAIL. Dimensioner: 57.4 X 80 X 14CM', 461),
(29759, 'Ford Trimotor', 'Ford Trimotor airplane model ', 292),
(29760, 'Junkers JU-52 \'Iron Annie\'', 'AN ICONIC EUROPEAN COUNTERPART OF THE FORD TRIMOTOR. IRON ANNIE VERSUS TIN GOOSE. CHARACTERISTIC STEEL PANELING. POPULAR FOR ITS COMFORT AND DEPENDABILITY. BAUHAUS TUBULAR SEATS. HEATING. ONBOARD INFORMATION SYSTEMS. BUILT IN DESSAU IN THE 30S, IT OFFERED AIRLINES RELIABLE SERVICE AND GREAT CARGO CAPACITY. AS A FULLY METAL BUILT, SCALE MODEL, ITS FUTURE VALUE WILL BE MANY TIMES CURRENT COST. GUARANTEED. AM LIMITED EDITION.  Dimensioner: 67.1 X 98 X 25.9CM.', 461),
(29761, 'Dakota DC3', 'Den mycket välkända Dakota DC3 var ett högpresterande plan som flög mellan år 1930 till 1950. Vissa flyger ännu planet på platser som Amazonas regnskog och Gobi-öken. Miniatyrplanet  är tillverkat i metall och är fyllt med detaljer som ger ett exklusivt utseende.\r\n\r\nVikt: 2,41kg\r\nMått: 65x98x17cm', 461),
(29762, 'Aviator Spitfire', 'Det legendariska högpresterande enmans planet Spitfire introducerades 1936. Planet blev känt för sitt försvar under slaget om Storbritannien 1940. Planet var en av det viktigaste stridsflygplanen under andra världskriget. Spitfire var även mycket betydelsefull av piloterna och idag är det en ikon bland entusiaster. \r\n\r\nVikt: 2,86kg\r\nMått: 61x75,6x17,1cm', 461),
(29764, 'Aviator Sopwith Camel', 'En flygplansmodell av den större storleken. Byggt på ett häpnadsväckande sätt i diverse material. Lättviktig flygplansram med stretchat transparent tyg. Flygplansmodellen passar större utrymmen men även större personligheter.\r\n\r\nTips! Sätt spotlights mot flygplansmodellen för att få en intresseväckande effekt. \r\n\r\nVikt: 4,54kg\r\nMått: 102,1x150,1x45,5cm', 461),
(29765, 'Sopwith Camel 2.5M Plan ', 'MOST DEFINITELY IT’S THE DIZE. IT’S BIG. BUILT WITH AN INTERESTING ARRAY OF MATERIALS. LIGHTWEIGHT FRAME STRETCHED WITH SILK FABRIC. DOWN TO SHTE SMALLEST DETAIL A REPLICA OF THE ORIGINAL, WHICH WAS ONLY 5,70M (LESS THAN 19 FT) LONG. BUILT BY THE THOUSANDS DURING THE GREAT WAR, IN MANY COLORS AND CONFIGURATIONS. \r\nDimensioner: 166.9 X 249.9 X 71.1CM', 461),
(29767, 'Bell Tower Antica', 'ARCHITECTURAL MODELS.MICHELANGELO HAD SEVERAL MODELS MADE OF THE ST. PETER DOME DURING THE TIME HE WORKED ON IT. DISCOVERED IN AN ATTIC AND NEWLY RESTORED, THESE MODELS ARE NOW A MAIN ATTRACTION AT THE VATICAN MUSEUM. ARCHITECTS OVER THE CENTURIES HAVE MADE MODELS TO CHECK DETAILS IN 3D AND HELP CLIENTS UNDERSTAND DIMENSIONAL PERSPECTIVES. MANY ARCHITECTS OF RENOWN ALSO COLLECTED MODELS, NOT ONLY FOR THEIR EXQUISITE WORKMANSHIP BUT ALSO FOR THEIR VALUE AS DÉCOR IN HOMES AND ESPECIALLY OFFICES. AM OFFERS A SMALL BUT NO LESS FASCINATING COLLECTION OF EARLY STAIR MODELS AND DOME BUILDINGS. CHERRY AND BIRCH WOOD FINISHED IN SUBTLE SHADES OF LIGHT AND DARK HONEY. SINUOUS CURVES AND ARCHES IN BEAUTIFULLY FINISHED WOOD ADD A FLUID TOUCH TO PRIVATE OR CORPORATE QUARTERS.\r\n\r\nDimensioner: 34.3 X 34.3 X 87.6CM', 466),
(29771, 'Miniatyr Kupol Demi Dome ', 'Som barn var vi nog många som var förtjusta i dockskåp som visades på museer och gallerier. Fascinationen för modeller i miniatyrer finns fortfarande kvar även när vi växer upp. Det är inte bara arkitekter som är intresserade av byggkonstruktion. Michelangelo och Da Vinci skapade småskaliga modeller av byggandes för deras kungliga och påvliga kunder. Låt denna vackra miniatyr modell i mahogany pryda ditt hem.  \r\n\r\nVikt: 1,88kg\r\nMått: 45,7x24,8x40.6cm', 466),
(29799, 'Jack Yacht', 'Jack Yacht är en perfekt inredningsdetalj som inte bara passar nautiska älskare, utan den passar fint i alla hem. Segelbåten representerar den dåtida nautiska perioden i sin vintage look. Mycket fin att ha i sovrummet och passar också fint att ha i ett barnrum då färgen som använts till segelbåten är fri från gifter. \r\n\r\nMått: 78x14x87,4cm', 465),
(29848, 'Thirst Extinguisher C. Shaker', 'THIRST EXTINGUISHER SHAKER STANDS TALL AND STATELY, OFFERING A REMINDER OF HOW TO MAKE THE CLASSICS?JUST ROTATE THE BASE AND READ THE MIX NEEDED FOR A DRY MARTINI A BETWEEN THE SHEETS, A CLOVER CLUB.', 463),
(29849, 'Shaker Fire Extinguisher', 'En elegant cocktail shaker som skiljer sig från de klassiska shakers. Designen gjorde att dessa blev mindre igenkännbara av polisen under 1920-talet när kongressen röstade om ett förbud, det så kallade \'\'The Prohibition\'\' mot alkoholhaltiga drycker. \r\n\r\nVikt: 0,61kg\r\nMått: 25cm', 463),
(29850, 'Joy Bell C. Shaker', 'HEADED UP BY THE BOSTON LIGHTHOUSE SHAKER, OUR NEW SPEAKEASY SPECIALS ALL FEATURE SURPRISING AND UNUSUAL SHAPES. DECORATIVE DESIGNS THAT DIFFERED FROM THE CLASSIC SHAKER SHAPE WERE IN FASHION, TO MAKE THEM LESS EASILY RECOGNIZED BY THE POLICE. ALL THIS WAS DURING THE 1920S WHEN THE CONGRESS VOTED IN THE PROHIBITION AND THE US WENT ‘DRY’. ILLEGAL BARS CALLED SPEAKEASIES CAME IN MANY VARIETIES. ALL SHAKERS ARE MADE OF HEAVILY SILVER-PLATED BRASS AND ARE FOOD SAFETY APPROVED.', 463),
(29851, 'Shaker Dumb Bell ', 'En elegant cocktail shaker som skiljer sig från de klassiska shakers. Designen gjorde att dessa blev mindre igenkännbara av polisen under 1920-talet när kongressen röstade om ett förbud, det så kallade \'\'The Prohibition\'\' mot alkoholhaltiga drycker. \r\n\r\nVikt: 1kg\r\nMått: 26cm', 463),
(29852, 'Shaker Lighthouse ', 'En elegant cocktail shaker som skiljer sig från de klassiska shakers. Designen gjorde att dessa blev mindre igenkännbara av polisen under 1920-talet när kongressen röstade om ett förbud, det så kallade \'\'The Prohibition\'\' mot alkoholhaltiga drycker. \r\n\r\nVikt: 1kg', 463),
(29886, 'Vaugondy 1745, Black', 'A contemporary classic. 1920s weber Castello globe is displayed on ebonized rosewood stand accented in nickel plated brass. Colored gores are applied to the globe core by hand with authentic construction and detail. ', 466),
(29889, 'Trianon Globe', 'Admittedly, Marie Antoinette wasn\'t remembered for her intellectual exploits. But during her time France sent expeditions around the globe. Scientists and explorers mapped landmasses and oceans, and recorded local flora and fauna. Undoubtedly a globe of some kind. ', 466),
(29898, 'Globe Base, Aluminum', 'SPHERES ARE HOME DÉCOR ITEMS PUR-SANG, AND WHAT BETTER SPHERE THAN THE ANTIQUE WORLD. SAIL SUNDA STRAIT, FILL THE HOLD AT THE SPICE ISLANDS, EVADE THE PIRATES FROM MADAGASCAR AND ROUND THE CAPE, THEN SAIL UP TO BRAZIL AND CROSS THE ATLANTIC FOR A SAFE LANDING IN 18TH C. AMSTERDAM…', 466),
(29899, 'Globe Base, Bronze', 'SPHERES ARE HOME DÉCOR ITEMS PUR-SANG, AND WHAT BETTER SPHERE THAN THE ANTIQUE WORLD. SAIL SUNDA STRAIT, FILL THE HOLD AT THE SPICE ISLANDS, EVADE THE PIRATES FROM MADAGASCAR AND ROUND THE CAPE, THEN SAIL UP TO BRAZIL AND CROSS THE ATLANTIC FOR A SAFE LANDING IN 18TH C. AMSTERDAM… Dimensioner: ', 466),
(30034, 'Artist Häst', 'Konst är för alltid och det kan man aldrig få för mycket av. Den här formen av konst är från den tid när konsten ansågs att vara ett hantverk för den begåvade. Skapa trivsel med den här vackra honungsfärgade inredningsdetaljen i rummet. \r\n\r\nVikt: 0,27kg\r\nMått: 22,6x6,1x23,1cm', 466),
(30035, 'Artus Häst', 'Konst är för alltid och det kan man aldrig få för mycket av. Den här formen av konst är från den tid när konsten ansågs att vara ett hantverk för den begåvade. Skapa trivsel med den här vackra honungsfärgade inredningsdetaljen i rummet. \r\n\r\nVikt: 0,89kg\r\nMått: 8,4x37,1x34cm', 466),
(30037, 'Phrenology Head', 'Frenologi betyder studier av kraniet och läran om mentala förmågor. Ett verktyg som passar in bra på det viktorianska skrivbordet. \r\n\r\nVikt: 1,95kg\r\nMått: 14x16,5x29cm', 466),
(30065, 'Indianapolis Bil ', 'ITS ORIGINAL MAKERS WERE THE FAMOUS DOOLING BROTHERS, WHO MANUFACTURED AROUND 1000 UNITS AT THE TIME. THEY WERE OFFERED TO AFICIONADOS OF THE FAMOUS DOOLING SPIN-DIZZIES, MINIATURE MOTORIZED RACECARS THAT REACHED DIZZYING SPEEDS. THEY WERE CLOSELY MODELED ON THE FAMOUS MERCEDES SILVER ARROWS OF THE EARLY 1930S. ORIGINALS ARE NOW RARE AND HIGHLY PRIZED BY COLLECTORS. MOLDED WITH THE SAME EXACTING DETAIL AS ITS ORIGINAL, OUR 12.2? INDY RACER IS HAND-CAST IN AIRPLANE ALUMINUM. HAND POLISHED AND BUFFED TO A HIGH SHINE, IT FEATURES A DETAILED DASHBOARD, FAUX LEATHER SEAT, STEERING WHEEL AND BRAKE. IN KEEPING WITH ITS ORIGINAL MODEL-TOY CHARACTER, THE FRONT WHEELS ARE NOT LINKED TO THE STEERING WHEEL. THE WHEEL HUBS AND RUBBER TIRES ARE MADE WITH THE SAME EXACT DETAIL AS THE ORIGINAL. ENJOY A TRULY UNIQUE PIECE OF GRAND PRIX HISTORY. THIS SHINY, SLEEK DESKTOP RACER REPRESENTS BOTH THE ROMANCE AND THE DRAMATIC BEAUTY OF THE MOST FAMOUS GRAND PRIX RACERS EVER!\r\n\r\nDimensioner: 31 X 13 X 8.9CM', 462),
(30066, 'Indianapolis, Red Seat Bil', 'ITS ORIGINAL MAKERS WERE THE FAMOUS DOOLING BROTHERS, WHO MANUFACTURED AROUND 1000 UNITS AT THE TIME. THEY WERE OFFERED TO AFICIONADOS OF THE FAMOUS DOOLING SPIN-DIZZIES, MINIATURE MOTORIZED RACECARS THAT REACHED DIZZYING SPEEDS. THEY WERE CLOSELY MODELED ON THE FAMOUS MERCEDES SILVER ARROWS OF THE EARLY 1930S. ORIGINALS ARE NOW RARE AND HIGHLY PRIZED BY COLLECTORS. MOLDED WITH THE SAME EXACTING DETAIL AS ITS ORIGINAL, OUR 12.2? INDY RACER IS HAND-CAST IN AIRPLANE ALUMINUM. HAND POLISHED AND BUFFED TO A HIGH SHINE, IT FEATURES A DETAILED DASHBOARD, FAUX LEATHER SEAT, STEERING WHEEL AND BRAKE. IN KEEPING WITH ITS ORIGINAL MODEL-TOY CHARACTER, THE FRONT WHEELS ARE NOT LINKED TO THE STEERING WHEEL. THE WHEEL HUBS AND RUBBER TIRES ARE MADE WITH THE SAME EXACT DETAIL AS THE ORIGINAL. ENJOY A TRULY UNIQUE PIECE OF GRAND PRIX HISTORY. THIS SHINY, SLEEK DESKTOP RACER REPRESENTS BOTH THE ROMANCE AND THE DRAMATIC BEAUTY OF THE MOST FAMOUS GRAND PRIX RACERS EVER!', 462),
(30067, 'Bantam Midget Bil', 'THE 1930S SAW THE RISE OF HAND BUILT MODEL RACECARS, KNOWN AS SPINDIZZIES OR TETHER CARS. MINIATURE RACECARS BUILT BY HOBBYISTS ZOOMED AROUND BANKED WOODEN TRACKS AT SPEEDS APPROACHING 150 MILES PER HOUR. RESEMBLING THE FULL-SIZE RACERS OF THEIR DAY, SEVERAL SPINDIZZIES COMPETED AT ONCE, TETHERED BY CABLES TO A CENTRAL POLE. POWERED BY MODEL AIRPLANE ENGINES, SPINDIZZIES RACED AGAINST THE CLOCK. INCREDIBLY DETAILED AND AERODYNAMIC, THESE MINIATURE RACECARS WERE BEYOND TOYS; THEY WERE PIECES OF ART REPRESENTATIVE OF THE BEST PIONEERING TECHNOLOGY OF THE ERA. CONSTRUCTED USING ORIGINAL BLUEPRINTS, OUR BANTAM MIDGET MODEL RESEMBLES THE ORIGINAL DOWN TO THE SMALLEST DETAIL. ONE LOOK AND YOU’LL BE READY TO JOIN THE COMPETITION. Dimensioner: 48 X 22.1 X 18CM', 462),
(30068, 'Bantam Midget Röd', 'Sofistikerade tävlingsbilar i minimodeller inspirerade från 1930-talet i en skala 1:8. Bilarna tävlade i höga hastigheter och man kunde höra hur motorerna mullrade innan tävlingen. An amerikansk dåtid av teknik, bilar och spänning. Modellen är tillverkad i metall, läder och mahogany. Låt denna klassiska bil pryda ditt hem och beundras. \r\n\r\nMått: 48x22,1x18cm', 462),
(30069, 'BB Korn Bil ', 'TECHNICALLY SKILLED ENTHUSIASTS OF THE 1930S LOVED TO RACE THE LEGENDARY B.B. KORN CARS AROUND THE CLUB TRACKS. CALLED TETHER CARS OR SPINDIZZIES, THEY REACHED INCREDIBLE SPEEDS, AND INSPIRED THOUSANDS TO IMPROVE AND INVENT. THE FOUNDER OF THE B.B. KORN MANUFACTURING COMPANY, BARNEY KORN, PRODUCED SEVERAL TETHER CAR MODELS THAT NOW, AS VINTAGE ANTIQUES, ACHIEVE ASTOUNDING SUMS AT AUCTION. Dimensioner: 52.7 X 24.8 X 17.8CM', 462),
(30070, 'BB Korn Red', 'Teknikintresserade entusiaster i början av 1930-talet älskade att tävla med dessa legendariska BB Korn bilar. Bilderna uppnådde otroliga hastigheter vilket inspirerade andra till att förbättra. Grundaren av BB. Korn Manufacturing Company, Barney Korn har producerat flera bilmodeller som idag räknas som antikvitet och får enorma belopp på auktioner. \r\n\r\nVikt: 3,27kg\r\nMått: 52,7x24,8x17,8cm', 462),
(30071, 'Silberpfeil', 'Silberpfeil dekorations bil', 462),
(30072, 'Silberpfeil Alu/Red Bil ', 'OUR ALUMINUM INDY RACER IS AN AUTHENTIC REPLICA OF A 1930S CHILD’S TOY. ITS ORIGINAL MAKERS WERE THE FAMOUS DOOLING BROTHERS, WHO MANUFACTURED AROUND 1000 UNITS AT THE TIME. THEY WERE OFFERED TO AFICIONADOS OF THE FAMOUS DOOLING SPINDIZZIES, MINATURE MOTORIZED RACECARS THAT REACHED DIZZYING SPEEDS. THEY WERE CLOSELY MODELED ON THE FAMOUS MERCEDES SILVER ARROWS OF THE EARLY 1930S. ORIGINALS ARE NOW RARE AND HIGHLY PRIZED BY COLLECTORS.\r\n\r\nDimensioner: 31.1 X 14.6 X 8.9CM', 462),
(30073, 'Hornet Bil', 'THE NEWEST ADDITION TO OUR LINE OF EARLY TOY SPEED CAR REPRODUCTIONS. THE ORIGINALS REACHED INCREDIBLE VELOCITIES USING SMALL ONE-CYLINDER ENGINES. NOISY, BUT FUN. GROWN BOYS’ TOYS OF THE 1940S AND 50S. TOY SPEED CARS WERE A BIG CRAZE OF THE TIME, BEFORE TV CHANGED HABITS OF ENTERTAINMENT AND HOBBIES FOREVER. Dimensioner: 31.1 X 14.6 X 8.9CM', 462),
(30074, 'Rocking Horse', 'YOUNGER SONS BORN INTO NOBILITY OR THE GENTRY WERE OFTEN SENT TO SERVE AT THE ROYAL COURT AS PAGES OF HONOR. PART OF THEIR EDUCATION WAS LEARNING TOURNAMENT JOUSTING. THE MASTER-AT-ARMS USED WOODEN HORSES MOUNTED ON SWINGS TO TEACH SKILLS WITH SWORD AND LANCE. THIS WOODEN HORSE EVOLVED OVER TIME INTO THE CLASSIC ROCKING HORSE. NO UPPER CLASS CHILDREN’S PLAYROOM WAS WITHOUT ONE. SOME WERE MOUNTED ON OVAL WOOD ROCKERS, OTHERS ON A ‘SAFETY’ STAND, WHERE STEEL SWINGS ALLOWED FOR GREATER MOVEMENT ON A STATIONARY BASE. OUR ICONIC ROCKING HORSE IS A FULL-SIZED REPRODUCTION OF ORIGINALS DATING BACK TO THE 19TH C. HAND CARVED IN TOP QUALITY MAHOGANY. HAND MADE SADDLE AND TACK OF REAL BRIDLE LEATHER. THE EXPERT SKILLS OF WOOD CARVERS, CABINETMAKERS, AND SADDLERS ARE EVIDENT. HAND FINISHED IN A WARM AND GLOWING FRENCH-STYLE VARNISH, SLIGHTLY DISTRESSED TO MAKE IT LOOK SOMEWHAT AGED. A TIMELESS TREASURE AND A DREAM-TOY FOR BOTH BOYS AND GIRLS. IMAGINE ITS VALUE IN 50 OR 100 YEARS!', 257),
(30156, 'Muse Noir Candle', 'Midnight black wax in a translucent porcelain vessel that glows as the candle burns. The scent: deep notes of bergamot and black plum mingled with amber and vetiver. And after the candle is gone? The vessel is the perfect pot for a posse of pretty posies.', 287),
