(30159, 'Brass Birds Salt Cellers', 'Our Brass Bird Salt Cellars add swanlike elegance to your tablescape. The miniature version of our signature Brass Bird Bowls, the pair includes coordinating brass spoons. Dreamy and surreal, they make seasoning a twinkly and sculptural statement. Hand-cast in solid brass and finished with food-safe lacquer.\r\n\r\nEach prototype starts its journey starts in our Soho studio, where Jonathan and his team design and hand-sculpt the original model in clay.', 192),
(30161, 'Dora Maar Urn', 'Inspired by Dora Maar, the French photographer, poet, and painter best known for being a lover and muse of Pablo Picasso.\r\n\r\nJonathan throws the models for the Muse vessels and then substitutes our signature geometric relief patterns with body parts—faces, breasts, lips—to create a surreal style. Each piece is made from unglazed matte porcelain to accentuate the forms and is inspired by our favorite artists\' muses.', 159),
(30162, 'Eve Serving Set', 'Our sculpturally seductive hands are ready to serve you. In gleaming brass finished with food-safe lacquer, they give an edgy glamour to whatever you\'re dishing out.\r\n\r\nOur Eve Serving Set starts its journey in our Soho studio where Jonathan and his team sculpt the original model. Next, it\'s cast in solid brass and finished with food-safe lacquer.', 196),
