(30754, 'Cire Trudon Reggio 270 g', 'Brought back from Indochina in 1828, the mandarin-tree has since prospered on the occidental banks of the Mediterranean Sea. Facing the Messina Strait, it sculpts the Calabrian landscape without a touch of bitterness. The mandarin’s softness hints back to ancient times when its essential oils composed an elegant, odorant grammar.', 287),
(30755, 'Cire Trudon Madurai 270 g', 'The Duke of Tuscany first brought jasmine in India in 1690, a flower originally from Arabia. Whether fresh or dried, they still play a quintessential role in India’s myths, legends and daily rituals. At times, jasminum sambac perfumes loose-leaf tea; at others, it is braided into floral necklaces. Revered spiritually, the odorant flower turns into an offering in Hindu temples.', 287),
(30756, 'Cire Trudon Tadine 270 g', 'When Englishman Edward Foxhall discovered sandalwood on the Isle of Pines, New-Caledonia, in 1840, it was, then, unknown in Europe. By the end of the 19th Century, the noble spiced wood had quite a pedigree: named ‘candana’ in Sanskrit, or ‘sandal’ in Arabic, it was used as a precious ointment for the hair and body. A remedy against anxiety, it still billows today, seamlessly embedded in the smoke of Asian incense.', 287),
