(30771, 'Harhuvud', 'Fint harhuvud att sätta upp på väggen som en gosig och rolig inredningsdetalj.', 253),
(30772, 'Junzo Taptap', 'Junzo Taptap  \r\nFör barn över 1,5 år', 243),
(30841, 'Newport Matbord Balmoral', 'Bord i svartlackerad pinjeträd\r\nDimensioner  B. 200  D. 66-160 cm  H. 78 cm\r\nMaterial: Pinje\r\nFärg: Black (*distressed) \r\n\r\n*Distressed är en metod som används för att uppnå ett lätt åldrat men elegant utseende (patina). Resultatet uppnås genom lätt slipning av hörn och kanter.\r\n\r\n\r\n\r\nNewport möbler\r\nThe Colored Pine Collection från Newport tillverkas i Europa av pinjeträd. De svartlackade möblerna är mycket omtyckta och är tillverkade för att hålla i flera generationer. En klassisk möbelserie där produktionen sker hantverksmässigt i egen regi med högsta kvalitet, materialval och omsorg.', 83),
(30848, 'Vas för Liljan Ljusstake', 'Ivar Ålenius Björk (1905 - 1978) arbetade som skulptör och är mest känd för sina byster. Hans offentliga utsmyckningar kan idag ses i många svenska städer. Ivar Ålenius Björk utformade en serie ljusstakar i mässing för den svenska tillverkaren Ystad-Metall som lades ner år 1969. Liljan var en av dessa ljusstakar och den har blivit en modern designklassiker som har förekommit i många internationella inredningar. I samarbete med Ivar Ålenius Björks anhöriga har Skultuna nu startat produktionen av Liljan igen. Designad för världsutställningen i New York 1939. Glasvasen fanns att köpa till originalet och finns nu tillgänglig igen.', 159),
(30921, 'Spike Candleholder', 'The Spike Series design Maria Nilsdotter. Smyckesdesignern Maria Nilsdotter är utbildad vid Central Saint Martins i London, hon driver sedan 9 år sitt eget varumärke med egen butik på Stureplan i Stockholm. Maria Nilsdotter har gjort sig känd för sin kompromisslösa, strama och samtidigt lyxigt punkiga formgivning som står för något helt nytt för Skultuna. Maria Nilsdotter om samarbetet; ”Det kändes spännande att låta Skultunas värld möta min. Jag tycker vi har många gemensamma värden som vikten av kvalité och material men samtidigt intressant att använda sig av kontrasterna mellan varumärkena också. Jag är väldigt glad över resultatet som känns både tidlöst, klassiskt och punkigt.” Formgiven år 2016.', 160),
