(30987, 'Liberty ljus 6-pack', 'Långa, ribbade ljus som brinner fint utan att rinna. Ljusen ger ett varmt och ombonat sken och skapar en hemtrevlig känsla. Brinntid ca 8 timmar. Innehåller ingen palmolja.', 160),
