(31022, 'Patina Oljelampa Mini Mässing', 'Den har fått namnet patina för att formgivarna vill att ytan skall få naturliga avtryck över tiden där ytan är ett minne av dess bruk och sammanhang. PATINA är tillverkad i stål med kopparyta eller med lackerad yta.\r\n\r\nTill skillnad från de större PATINA – lamporna som har ett reglage – så har patina Mini endast en glasfiberveke. Minilampan ger ett sken som ett vanligt stearinljus och lågans styrka regleras med hur mycket av veken som sticker upp. Till skillnad från bomullsveken så kan inte glasfiberveken brinna, dess funktion är endast att transportera olja. Glaset ligger inne i förpackningen och är alltid av klart glas. PATINA Mini är tillverkad i mässing och finns även med koppar eller lackerad yta.', 452),
