(31637, 'Adventsljusstake Asteri', 'Newport lanserar årets adventsljusstake i en limiterad upplaga\r\n\r\nAdventsljusstaken Asteri är formgiven och tillverkad av den svenska designern Niklas Liljeblad. Med den grundläggande tanken att låta klassiska produkter få anta nya former föddes idén till det framgångsrika samarbetet. Ljusstakens design förtrollar på ett lekfullt sätt genom ljusets reflektioner i den blankpolerade mässingen. Asteri tillverkas i Söderköping enligt traditionella metoder och är en hyllning till den svenska designen och det svenska hantverket. Upplagan är begränsad till 300 stycken där varje ljusstake är numrerad med sitt unika tillverkningsnummer. Asteri är den första ljusstaken som lanseras i det som kommer att bli en årlig tradition, där en ny ljusstake i limiterad upplaga kommer att tas fram varje år.\r\n\r\nNiklas Liljeblad är en av ytterst få tillverkare i Sverige som fortfarande bemästrar den svenska hantverkstraditionen och månar om att låta den leva vidare. Hans förmåga att hantera material och traditionell produktion, tillsammans med enastående hantverk är också det som banat väg för samarbete med några av Sveriges ledande designföretag.\r\n', 160),
