(31656, 'North Africa Matta 86x291 cm ', 'Marockans Designad matta\r\nSmutsavvisande och näst intill outslitliga mattor av högkvalitativ ull med marockans design. Mattorna produceras av erkänt skickliga hantverkare som kommer från en lång tradition av mattknytning. De är tätknutna och har den lite strävare lugg som blir resultatet när man använder handspunnet garn.\r\n\r\nTillverkningsteknik: Handknuten\r\nUrsprungsområde: Asien\r\nLugg: Ull\r\nVarp: Bomull', 443),
(31657, 'Kelim 165x245', 'Kelimer är egentligen namnet på en speciell vävteknik, men har utvecklats till att mer eller mindre bli ett samlingsnamn för slätvävda mattor. \r\nTillverkningsteknik: Handvävd \r\nUrsprungsområde: Pakistan \r\nVäft: Ull \r\nVarp: Ull ', 443),
(31658, 'Decolorized Matta', 'De infärgade mattorna är i grunden antika, eller semi-antika, handknutna Orientmattor, som fått nytt liv med hjälp av nya nyanser. Tekniken som används ger en ytterst levande yta, med många skiftningar och schatteringar, som stundtals också låter betraktaren ana den ursprungliga mönsterbilden. Kombinationen av unika och traditionella mattor och samtida färger resulterar i en inredning full av trendig retro-känsla.\r\nTillverkningsteknik: Handknuten \r\nUrsprungsområde: Asien \r\nLugg: Ull \r\nVarp: Bomull ', 443),
(31659, 'Decolorized Matta 289x396', 'De infärgade mattorna är i grunden antika, eller semi-antika, handknutna Orientmattor, som fått nytt liv med hjälp av nya nyanser. Tekniken som används ger en ytterst levande yta, med många skiftningar och schatteringar, som stundtals också låter betraktaren ana den ursprungliga mönsterbilden. Kombinationen av unika och traditionella mattor och samtida färger resulterar i en inredning full av trendig retro-känsla.\r\nTillverkningsteknik: Handknuten \r\nUrsprungsområde: Asien \r\nLugg: Ull \r\nVarp: Bomull ', 443),
(31660, 'North Africa Matta 243x346 cm', 'Marockans Designad matta \r\n\r\nSmutsavvisande och näst intill outslitliga mattor av högkvalitativ ull med marockans design. Mattorna produceras av erkänt skickliga hantverkare som kommer från en lång tradition av mattknytning. De är tätknutna och har den lite strävare lugg som blir resultatet när man använder handspunnet garn. \r\nTillverkningsteknik: Handknuten \r\n\r\nUrsprungsområde: Asien \r\nLugg: Ull \r\nVarp: Bomull ', 443),
(31661, 'DEHBAF 251x298', 'De fantastiska växtfärgade Dehbaf mattorna med sin behagliga och naturliga färgton är knutna av fet, afghansk ull. Upptäck de naturliga skiftningarna och nyanserna som endast växtfärgad garn av finaste ullkvalitet kan skapa, i allt från mer traditionella designer till moderna kreationer.\r\nTillverkningsteknik: Handknuten \r\nUrsprungsområde: Afghanistan \r\nLugg: Ull \r\nVarp: Bomull ', 443),
(31662, 'North Africa 270x383 cm', 'Marockans Designad matta\r\n\r\nSmutsavvisande och näst intill outslitliga mattor av högkvalitativ ull med marockans design. Mattorna produceras av erkänt skickliga hantverkare som kommer från en lång tradition av mattknytning. De är tätknutna och har den lite strävare lugg som blir resultatet när man använder handspunnet garn.\r\n\r\nTillverkningsteknik: Handknuten\r\nUrsprungsområde: Asien\r\nLugg: Ull\r\nVarp: Bomull', 443),
(31663, 'Orient Ikat Grey Matta 166x244 cm', 'Ikat\r\nDe underbara, kraftiga, varma Ikat-ullmattorna spänner från ett modernt, monokromt och sparsmakat formspråk till fantastiska färgsprakande kreationer med Ikat motiv. Det handspunna garnet, med dess ojämna tjocklek borgar för unika och underbara mattor.\r\nTillverkningsteknik: Handknuten \r\nUrsprungsområde: Pakistan \r\nLugg: Ull \r\nVarp: Bomull ', 443),
(31665, 'Orient SilkTouch Blue Beige Matta 169x248 cm ', 'En fantastisk matta där mixen av material ger en unik tredimensionell effekt. En matta som andas exklusivitet och elegans.\r\nTillverkningsteknik: Handknuten \r\nUrsprungsområde: Pakistan \r\nLugg: Ull, naturfiber &silke \r\nVarp: Bomull', 443),
(31666, 'Orient Silk Touch Pink Beige Matta 170x230 ', 'En fantastisk matta där mixen av material ger en unik tredimensionell effekt. En matta som andas exklusivitet och elegans.\r\n\r\nTillverkningsteknik: Handknuten\r\nUrsprungsområde: Pakistan\r\nLugg: Ull, naturfiber &silke\r\nVarp: Bomull', 443),
(31667, 'Kelim Raw 171x267 ', 'En melerad kelimmatta i ofärgat garn av högsta kvalitet. Ett traditionellt geometriskt mönster med mycket diamanter smyckar mattan. Härligt värmande och smutsavvisande ull sprider ombonad värme och ger mattan lång livslängd.\r\nTillverkningsteknik: Handvävd \r\nUrsprungsområde: Afghanistan \r\nVäft: Ull \r\nVarp: Ull ', 443),
(31668, 'Orient Pashtu silk Grey White 198x312', 'En fantastisk matta där mixen av material ger en unik tredimensionell effekt. En matta som andas exklusivitet och elegans.\r\n\r\nTillverkningsteknik: Handknuten\r\nUrsprungsområde: Pakistan\r\nLugg: Ull, naturfiber &silke\r\nVarp: Bomull', 443),
(31670, 'Kelim Raw 171x250', 'En melerad kelimmatta i ofärgat garn av högsta kvalitet. Ett traditionellt geometriskt mönster med mycket diamanter smyckar mattan. Härligt värmande och smutsavvisande ull sprider ombonad värme och ger mattan lång livslängd.\r\nTillverkningsteknik: Handvävd \r\nUrsprungsområde: Afghanistan \r\nVäft: Ull \r\nVarp: Ull ', 443),
(31671, 'Decolorized 293x388', 'De infärgade mattorna är i grunden antika, eller semi-antika, handknutna Orientmattor, som fått nytt liv med hjälp av nya nyanser. Tekniken som används ger en ytterst levande yta, med många skiftningar och schatteringar, som stundtals också låter betraktaren ana den ursprungliga mönsterbilden. Kombinationen av unika och traditionella mattor och samtida färger resulterar i en inredning full av trendig retro-känsla.\r\nTillverkningsteknik: Handknuten \r\nUrsprungsområde: Asien \r\nLugg: Ull \r\nVarp: Bomull ', 443),
(31672, 'Pashtu Ikat Grey 243x358 cm ', 'Ikat\r\nDe underbara, kraftiga, varma Ikat-ullmattorna spänner från ett modernt, monokromt och sparsmakat formspråk till fantastiska färgsprakande kreationer med Ikat motiv. Det handspunna garnet, med dess ojämna tjocklek borgar för unika och underbara mattor.\r\nTillverkningsteknik: Handknuten \r\nUrsprungsområde: Pakistan \r\nLugg: Ull \r\nVarp: Bomull ', 443),
(31673, 'Flow 255x350 cm ', 'Lättplacerade mattor i läckra färger. Modernt formspråk med högklassig glansig ull från Himalayas bergstrakter. \r\nTeknik: Handknuten\r\nLugg: fin ull & Bambu silke\r\nVarp: Bomull\r\nKnuttäthet: ca 60 Line\r\nTjocklek: 6-10 mm \r\nTillverkningsområde: Nepal ', 443),
(31675, 'Paris Karaff Guld  1 liter', 'Vi presenterar stolt det exklusiva nytillskott i vår serie munblåsta karaffer. En vacker och tidlös karaff, som tillverkas i ett litet traditionellt glasbruk. Fin att använda både till svala drycker eller som vas. De munblåsta bubblorna ger glaset dess karaktäristiska mönster och det vackra guldhandtaget sätter en unik, luxiös  prägel på dukningen. De flera delarna av karaffer, skålar och vaser ur samma kollektion, är fina både var och för sig eller samlade i grupp.  En unik serie munblåsta produkter, där tillbringaren blivit en klassisk detalj och uppskattad gåva, ofta omnämnd som Linné Carafe. ', 193),
(31684, 'Paris Karaff Åskblå Guld  1 liter', 'Vacker och tidlös tillbringare med guldhandtag, som tillverkas i ett litet traditionellt glasbruk. Fin att använda som både mjölkkanna eller vinkaraff. De munblåsta bubblorna med gulddetaljer ger glaset dess karaktäristiska mönster och sätter en unik prägel på dukningen. De flera delarna av karaffarer, skålar och vaser ur samma kollektion, är fina både var och för sig eller samlade i grupp.  En unik serie munblåsta produkter, där tillbringaren blivit en klassisk detalj och uppsakattad gåva, ofta omnämnd som Linné Carafe. ', 193),
