(31702, 'Snöbär', 'Bärkvist med vita snöbär gjord av högsta kvalité för att skapa en naturtrogen känsla i ditt hem. Passar perfekt i vas eller kruka. Mixa och kombinera med andra snittblommor för att skapa en ståtlig bukett. ', 447),
