(31810, 'Blue Italian Assiett ', 'Blue Italian lanserades redan år 1816 och har tillverkats sedan dess av Spode. Väldetaljerad med inspiration hämtad ur den äldre Italienska landsbygden omsluten i en ram utav ett 1700-tals Imari Oriental. Blue Italian Assiett kan kompletteras med en mängd andra artiklar både porslin, textilier och brickor i den vackra och tidlösa Blue Italien kollektionen.\r\n\r\nSäker användning:\r\nDiskmaskinsäker\r\nMikrovågsugnsäker\r\nUgnsäker <170grader\r\nFryssäker\r\n', 197),
(31811, 'Blue Italian Cereal Bowl ', 'Väldetaljerad med inspiration ur den äldre Italienska landsbygden omsluten i en ram utav ett 1700-tals Imari Oriental. Blue Italian Frukostskål kan kompletteras med en mängd andra artiklar både porslin,textilier och brickor i den vackra och tidlösa Blue Italien kollektionen.\r\n\r\nSäker användning:\r\nDiskmaskinsäker\r\nMikrovågsugnsäker\r\nUgnsäker <170grader\r\nFryssäker', 197),
(31814, 'Strawberry Thief Red Mugg & brickset ', 'Brickan med handtag är i melamin och muggarna rymmer 0,18L.\r\n\r\nVåra kvalitets melamin brickor från Pimpernel / Portmeirion är slitstarka, robusta och tåliga. Brickorna tål maskindisk och är därmed praktiskta att använda varje dag. Melamin brickorna är inte bara slitstarkta utan de är också fantastiskt vackra och har en mängd olika dekorativa mönster. Ett perfekt komplement till vår omfattande samling av porslin, bordsunderlägg, glasunderlägg och en mängd textilier i samma serie.\r\n\r\nSkötsel: Använd en fuktig trasa med eller utan mild diskmedel eller utspätt ättika i vatten. Använd inte slipande rengöringsmedel. Placera inte heta föremål på melamin eftersom det kan uppkomma blåsor och förstöra melaminet. Använd inte melaminprodukter som skärbrädor.\r\n\r\nSäker användning:\r\nDiskmaskinsäker', 451),
