(31968, 'Elephant Petite serving bowl ', 'Sinuous and surreal, our solid brass homage to the elephant is topped with a petite bowl. Adds a surreal height to a dining table, or keep on your cocktail table with nuts or candies.\r\n\r\nEach prototype starts its journey starts in our Soho studio, where Jonathan and his team design and hand-sculpt the original model in clay. It\'s then hand-cast in solid brass and finished with food-safe lacquer.\r\n\r\nLike a fine wine or your favorite leather jacket, our brass only gets better with age. Over time, the polished brass will develop a rich natural patina. If desired, use a microfiber cloth to buff out fingerprints. If you have no patience for patina, use a brass polish', 162),
(31969, 'Ostrich Petite Serving Bowl', 'Vacker skål i 100% mässing från Jonathan Adler - Ostrich Petite Serving Bowl är lika fin som en inredningsdetalj som en serveringsskål.\r\n\r\nMått: 10,5x16,5 cm', 162),
