(31994, 'Georgia Orb - White', 'A purely decorative take on our popular Georgia pottery (inspired by American artist Georgia O’Keeffe, wife and muse to Alfred Stieglitz) this orb is an idealized eye-catcher with a bold motif.\r\n\r\nJonathan throws the models for the Muse vessels and then substitutes our signature geometric relief patterns with body parts—faces, breasts, lips—to create a surreal style. Each piece is made from unglazed matte porcelain to accentuate the forms and is inspired by our favorite artists’ muses.', 292),
