(31997, 'Gala Round Vase', 'Inspired by Gala, wife and muse of Salvador Dali. Crafted from unglazed matte porcelain to create an ethereal vibe.\r\n\r\nEach prototype starts its journey in our Soho studio, where Jonathan throws the models for the Muse vessels and then substitutes our signature geometric relief patterns with body partsâ??faces, breasts, lipsâ??to create a surreal style.', 159),
(31998, 'Vice Canister - Calories', 'Guilty Pleasures.\r\n\r\nCelebrate all of life\'s little helpers with our porcelain Vice Canisters. Our iconic canisters highlight various indulgences in irresistible hues.\r\n\r\nThe prototypes are designed and sculpted by Jonathan and his team in our Soho studio, then crafted from white porcelain and glazed with rich hues. Get a gaggle for your kitchen countertop, keep one bedside for any late night cravings, or go wild and collect our whole set.', 162),
