(32692, 'Teak Shield Golden Care', 'Skötselråd teak: \r\n\r\nEventuella fläckar ska torkas bort omedelbart för att undvika att de blir permanenta. Se till att hela träytan exponeras för samma mängd solljus för att minska risken för\r\natt färgen bleks ojämnt av solen. Det kan uppstå små sprickor. Även temperatur och luftfuktighet påverkar träets beteende och skruvar och delar bör justeras regelbundet. Torka av med en fuktig trasa. Möblerna bör behandlas ett par gånger per år med “Teak Shield” för att behålla sitt skydd mot fläckar och vatten. Använd inte rengöringsmedel. Placeras torrt och fritt från temperaturväxlingar vid vinterförvaring.', 0),
