(33450, 'Edwin Jagger rakset 3 delar “horn\"', 'Rakställ med rakhyvel och rakborste. Rakborste med grävlingshår, krompläterat skaft med sköldpaddsfärgad/brunmelerad detalj i plast. Rakhyvel kompatibel med Mach3 rakblad Gillette \"Genuine parts\", krompläterad med sköldpaddsfärgad/brunmelerad detalj i plast på handtag.\r\nBorsten rengöres i varmt vatten efter rakning och överflödigt vatten skakas försiktigt ur. Torkas mest lämpligt hängande upp och ner, gärna i rakställ.\r\nEn rakborste med grävlingshår är en naturprodukt som med korrekt behandling bör hålla i 10-15 år. På nya borstar är det helt naturligt om lösa strån lossnar från borsten under de första veckorna. Dessa är kortare hår som inte riktigt når ner till bindningen och limmet i botten vilket är helt naturligt.', 280),
