(33524, 'North Africa 263x340', 'Marockans Designad matta\r\nSmutsavvisande och näst intill outslitliga mattor av högkvalitativ ull med marockans design. Mattorna produceras av erkänt skickliga hantverkare som kommer från en lång tradition av mattknytning. De är tätknutna och har den lite strävare lugg som blir resultatet när man använder handspunnet garn.\r\n\r\nTillverkningsteknik: Handknuten\r\nUrsprungsområde: Asien\r\nLugg: Ull\r\nVarp: Bomull', 443),
(33525, 'North Africa 89x300 cm', 'Marockans Designad matta\r\nSmutsavvisande och näst intill outslitliga mattor av högkvalitativ ull med marockans design. Mattorna produceras av erkänt skickliga hantverkare som kommer från en lång tradition av mattknytning. De är tätknutna och har den lite strävare lugg som blir resultatet när man använder handspunnet garn.\r\n\r\nTillverkningsteknik: Handknuten\r\nUrsprungsområde: Asien\r\nLugg: Ull\r\nVarp: Bomull', 443),
(33526, 'Kelim Raw 156x211', 'En melerad kelimmatta i ofärgat garn av högsta kvalitet. Ett traditionellt geometriskt mönster med mycket diamanter smyckar mattan. Härligt värmande och smutsavvisande ull sprider ombonad värme och ger mattan lång livslängd.\r\nTillverkningsteknik: Handvävd \r\nUrsprungsområde: Afghanistan \r\nVäft: Ull \r\nVarp: Ull ', 443),
(33527, 'Kelim 171x237', 'Kelimer är egentligen namnet på en speciell vävteknik, men har utvecklats till att mer eller mindre bli ett samlingsnamn för slätvävda mattor. \r\nTillverkningsteknik: Handvävd \r\nUrsprungsområde: Pakistan \r\nVäft: Ull \r\nVarp: Ull ', 443),
(33528, 'Decolorized 257x361', 'De infärgade mattorna är i grunden antika, eller semi-antika, handknutna Orientmattor, som fått nytt liv med hjälp av nya nyanser. Tekniken som används ger en ytterst levande yta, med många skiftningar och schatteringar, som stundtals också låter betraktaren ana den ursprungliga mönsterbilden. Kombinationen av unika och traditionella mattor och samtida färger resulterar i en inredning full av trendig retro-känsla.\r\nTillverkningsteknik: Handknuten \r\nUrsprungsområde: Asien \r\nLugg: Ull \r\nVarp: Bomull ', 443),
(33529, 'Pashtu ikat 165x233', 'Ikat\r\nDe underbara, kraftiga, varma Ikat-ullmattorna spänner från ett modernt, monokromt och sparsmakat formspråk till fantastiska färgsprakande kreationer med Ikat motiv. Det handspunna garnet, med dess ojämna tjocklek borgar för unika och underbara mattor.\r\nTillverkningsteknik: Handknuten \r\nUrsprungsområde: Pakistan \r\nLugg: Ull \r\nVarp: Bomull ', 443),
(33530, 'Dehbaf 172x237', 'De fantastiska växtfärgade Dehbaf mattorna med sin behagliga och naturliga färgton är knutna av fet, afghansk ull. Upptäck de naturliga skiftningarna och nyanserna som endast växtfärgad garn av finaste ullkvalitet kan skapa, i allt från mer traditionella designer till moderna kreationer.\r\nTillverkningsteknik: Handknuten \r\nUrsprungsområde: Afghanistan \r\nLugg: Ull \r\nVarp: Bomull ', 443),
(33531, 'Key Largo Lounge', 'Stilrena Key Largo loungefåtölj från Artwood i väderbeständig vintagegrå konstrotting med en stomme av aluminium. En dyna med med avtagbar klädsel i 100 % polyester i offwhite ingår, kemtvätt rekommenderas. \r\n\r\nw 79 x d 82 x h 84 cm. ', 360),
