(33895, 'Giant Dora Maar', 'Den ståtliga vasen Giant Dora Maar. Inspirerad av den franska fotografen, poeten, konstnären men som mest känd för att varit Picassos älskarinna. \r\n34 cm hög', 159),
(33897, 'Animalia Zebra Salt & Peppar', 'Spice Safari. 2 st zebrahuvuden som salt och pepparkar. Ligger i en fin presentbox av högbränt porslin och handmålade med 24-karats guldlyster.\r\n\r\nMått: 7,50x3,80cm', 192),
(33925, 'Muse Creamer', 'Muse Mjölk/Grädd-kanna glaze i vit porslin. Elegant liten kanna tillhörande Muse serien ifrån Jonathan Adler. Inspirerad av en kärleksaffär mellan Salvador and Misia. ', 193),
