(33988, 'Eve Cocktail Servetthållare', 'Napkins have never looked niftier than in our Eve Cocktail Napkin Holder. In gleaming, hand-cast polished brass, she glamorously elevates even plain paper. The weighted hand keeps your linens locked in place. Our Eve Cocktail Napkin Holder starts its journey in our Soho studio where Jonathan and his team sculpt the original model before it\'s crafted from black enamel and polished brass.\r\n\r\nMått: 13.34x13.34x5cm', 172),
