(34105, 'Miss Laura - Poster ', ' Miss Laura kan stirra ner i det mörka vattnet i timmar. Hon tröttnar aldrig. Sjön ger henne glimtar av framtiden när hon tyder vattnets språk och vet precis när det är dags att dyka ner eller ropa på hjälp. Hon känner av luftens signaler, kan prata med djuren och förmedlar lugn.\r\n\r\nPostern är 30x40 cm och tryckt på 170g Munken Polar Rough matt papper för att bibehålla den fina känslan av originalet i akvarell. Limiterad upplaga, när den är slutsåld är den slut för alltid. ', 269),
(34107, 'Miss Eva - Poster ', 'Miss Eva sprider lycka. När svårmodet tar fäste och det hårda arbetet gnager på hennes vänner skrattar Eva. Hon är vågskålen mellan dysterhet och glädje då hennes skratt är som medicin. Eva tar över andras sorger och rädslor och ger tillbaka i ren glädje.\r\n\r\nPostern är 30x40 cm och tryckt på 170g Munken Polar Rough matt papper för att bibehålla den fina känslan av originalet i akvarell. Limiterad upplaga, när den är slut är den  slut för alltid. ', 269),
(34111, 'Mr & Mr Muse Salt & Peppar', 'Mr. & Mr  Muse salt- & pepparströare från Jonathan Adler. Här kommer två härliga shakers som har en stilren form blandat med sina unika uttryck. Härliga i sig själva och funktionella genom sin design. Ha dem synliga på matbordet för familj, vänner och gäster!\r\n\r\nMått: 8,9 cm', 192),
(34113, 'Eve Candle Holder', 'Jonathan Adlers Eve Candle Holder är en ljusstake helt i mattvitt proslin, föreställande en hand med en slingrande orm. Både finish och färg matchar stora delar av Jonathan Adlers vaser, skålar och andra detaljer. Detta gör att de snyggt kan placeras i grupp för en effektfull helhet. Eve Candle Holder ingår i kollektionen Muse Collection.\r\n\r\nMått: 11x18cm', 160),
