(34216, 'Stol Gatsby ', 'Stol med stoppad sits i off-white färgat linnetyg i massiv brun betsad mahogny\r\nDimensioner:  B: 50cm D:57cm H:80cm\r\nMaterial: Massiv mahogny\r\nFärg: Varm brun \r\n\r\nNewport möbler\r\nThe Mahogny Collection från Newport är en ny serie möbler tillverkade av massiv Mahogny med ett enkelt formspråk inspirerat av New Englands tidiga \"Shaker Movement\". Shakers blev kända för sina gårdstillverkade möbler med mångsidig funktion, enkel stil, genuina träslag och lagom mycket utsmyckning. En stor del av New Englands inredning, både antik och nytillverkad, är baserad på Shaker-rörelsens stilrena bord, stolar och skåp. Möblerna är mycket omtyckta och är tillverkade för att hålla i flera generationer. Den klassiska möbelserien tillverkas i Europa och produktionen sker hantverksmässigt i egen regi med högsta kvalitet, materialval och omsorg', 435),
