(34252, 'Cire Trudon Madeleine 270g', 'Doftljus från Cire Trudon. Madeleine – Cuir Fleuri – \r\n\r\nDenna skrävlande doft är en hyllning till Madeleine de Maupin – skicklig ryttarinna och fäktare på 17-talet.\r\nIris, jasmin och ros i en djärv kombination med läder gör denna doft till en favorit.\r\n\r\nHuvudnot: Castoreum, Kläver, Lavender\r\nHjärtnot: Iris, Jasmin, Ros, Vetiver\r\nBasnot: Läder, Mossa, Patchouli, Tobak', 287),
(34253, 'Wax Bust Esclave Carpeau Stone', 'Pourquoi naître esclave (Why born a slave) is the name given by sculptor and painter Jean-Baptiste Carpeaux (1827-1875) to a series of busts he created around 1870. At the heights of his career, enjoying the protection of Napoleon III, Carpeaux was commissioned by the city of Paris to design the Fontaine de l’Observatoire and slightly modified the theme imposed on him – the four cardinal points – by replacing them with allegoric characters personifying Europe, Africa, Asia and America. While he was working on the representation of Africa, he came up with the idea of the bust of the Négresse Captive. Obsessed with faithful representations of human movement, he sculpted his slave at an angle in order to express revolt. The story goes that the woman who posed for the bust might have also been the model of the “Capresse des colonies” by Charles Cordier in 1861.', 287),
(34254, 'Wax Bust Marie Antoniet Grey', 'This little-known copy of Marie-Antoinette of Austria is attributed to one of the Brachard brothers, either the eldest, Jean-Charles-Nicolas or the youngest, Jean-Nicolas-Alexandre. This object is an idealized portrait of the queen instead of the evocation of a sovereign at the height of her power. The head is slightly turned to the right; the shoulders are covered with a swath of fabric for a natural effect; she is wearing a crown decorated with a fleur-delis and a row of pearls. As one of the most famous and controversial women in French History, Marie-Antoinette was the object of many artistic representations. Many valuable pieces disappeared during the French Revolution. Fortunately, some copies have survived the upheavals of time.', 287),
