(35127, 'Tortoise Salt & Peppar set ', 'Salt och pepparkar tillverkade av porslin som avbildar två små sköldpaddor. Skalen är förgyllda med 16karats guld och detta blir en fin detalj att ha på det dukade bordet. \r\n\r\nDessa levereras i en fin presentask. \r\n\r\nProdukten bör handdiskdiskas\r\nMått: 9,5cm x 6,4cm x 5,8cm', 192),
(35128, 'Louis Vuitton: A Passion for Creation', 'The more than eighty collaborators featured in this book comprise an A to Z of Vuitton s creative collaborations, especially from the last decade, with significant chapters devoted to the work of Nicolas Ghesquiere, Marc Jacobs, Takashi Murakami and other key collaborators. Never forgetting the long tradition of the house, the period covered by the book from the late 1990s through the present day will describe the role that Louis Vuitton is playing in a crucial moment in global fashion. \r\n\r\nNow with 536 pages, this edition features more than 130 pages of stunning new imagery that showcases the increasingly symbiotic relationship between fashion, art, and design.', 0),
(35129, 'Eve Ljusstake ', 'Eve Ljusstake - Ett rent hantverk utformad och designad av Jonathan Adler. \r\nMed inspirationen som hämtad ifrån självaste Eva som med frestad hand sträcker sig efter den förbjuden frukten i Edens lustgård. \r\nPryd din nästa middagsbjudning med den sexarmade ljusstaken som både utstrålar lekfull kreativitet och elegans. \r\n\r\nMått: 34,5 cm x 23cm', 160),
(35130, 'Charade Studded Taper vas ', 'Vasen som är briljant för buketter av begonier eller påfågelfjädrar. \r\n\r\nMått: Dia 10,2cm x H 22cm \r\n\r\nVasen har noggrant handskurna detaljer gjutna i högkvalitativt mattporslin. Varje modell av Adlers vaser börjar sin resa i Soho keramikstudio där Jonathan och hans team handskulpterar den ursprungliga modellen i lera. ', 159),
