(35139, 'Orchidé i kruka 70cm', 'Här är perfekta inredningsdetaljen - Orchidén som alltid blommar. \r\nNu kan du skapa botaniska miljöer i ditt hem, vår konstgjorda Orchidé kommer i en vas av klarglas med naturtroget utseende från rötterna till de klorofyll fyllda bladen och den blommande blomman. \r\nMått: 70cm hög. ', 327),
(35140, 'Orchidé i kruka 90cm', 'Här är perfekta inredningsdetaljen - Orchidén som alltid blommar. \r\nNu kan du skapa botaniska miljöer i ditt hem, vår konstgjorda Orchidé kommer i en vas av klarglas med naturtroget utseende från rötterna till de klorofyll fyllda bladen och den blommande blomman. ', 327),
(35141, 'Eucalyptus 100 cm', 'Fyll en vas eller stor kruka med ett fång gröna eucalyptusgrenar, skapar en botanisk känsla och blir till en bestående inredningsdetalj. \r\nMått: 100cm\r\n', 327),
(35142, 'Monstera 60cm Snittblomma', 'Monsteran och dessa stora fylliga blad kommer nu alltid grönska i ditt hem. Sätt ett eller flera blad tillsammans i en hög vas, växterna består nu och blir till inredningsdetaljer för ditt hem. \r\n\r\nMått: 60cm', 327),
(35143, 'Midnight Blue Bordsunderlägg 4-pack ', 'Vackra och klassiska bordsunderlägg Midnight Blue i mörkblå med trippel guld bård. Levereras i 4-pack. \r\n\r\nAlla bordsunderlägg och glasunderlägg från Pimpernel tillverkas med en oöverträffad skiktsystem med en korkbas, lövträ i mitten, fantastisk design och avslutas slutligen med en skyddande och slitstark film. Vi rekommenderar att man rengör bordsunderläggen med en fuktig trasa.', 194),
(35144, 'Midnight Blue Glasunderlägg 6-pack', 'Vackra och klassiska glasunderlägg Midnight Blue i mörkblå med trippel guld bård. Levereras i 6-pack. \r\n\r\nAlla bordsunderlägg och glasunderlägg från Pimpernel tillverkas med en oöverträffad skiktsystem med en korkbas, lövträ i mitten, fantastisk design och avslutas slutligen med en skyddande och slitstark film. Vi rekommenderar att man rengör bordsunderläggen med en fuktig trasa.', 184),
