(35147, 'Emerald Bordunderlägg 4-pack', 'Duka bordet med Emerald bordunderlägg i en underbar grönnyans med trippel bård av guld. Kommer i 4-pack. \r\n\r\nAlla bordsunderlägg och glasunderlägg från Pimpernel tillverkas med en oöverträffad skiktsystem med en korkbas, lövträ i mitten, fantastisk design och avslutas slutligen med en skyddande och slitstark film. Vi rekommenderar att man rengör bordsunderläggen med en fuktig trasa.', 194),
