(35174, 'Skohorn i mässing ', 'Ett gediget skojhorn i mässing. Klassisk design med raka linjer där det enkla blir det vackra. \r\n\r\nMått: 28,5cm x 4,5cm ', 0),
(35175, 'Vas Pomme Mässing ', 'Pomme är en sfärisk liten vas och ljushållare tillverkad av klart glas och polerad mässing. Pommes form och utseende är inspirerad av naturens runda former. Namnet Pomme kommer från det franska ordet för äpple, varifrån produkten lånat sin organiska form. Pomme kan användas som en vas för snittblommor och mässingsbasen som en ljushållare för värmeljus.', 159),
(35176, 'Vas Pomme Vit', 'Pomme är en sfärisk liten vas och ljushållare från Skultuna tillverkad av klart glas och polerad mässing. Pommes form och utseende är inspirerad av naturens runda former. Namnet Pomme kommer från det franska ordet för äpple, varifrån produkten lånat sin organiska form. Pomme kan användas som en vas för snittblommor och mässingsbasen som en ljushållare för värmeljus.', 159),
(35177, 'Vas Tatlin ', 'Ivar Ålenius Björks Tatlin vas återuppstår! Ivar Ålenius Björk (1905 - 1978) arbetade som skulptör, mest känd för sina bystporträtt. Hans offentliga utsmyckningar kan ses i många svenska städer. Han designade också en serie produkter till Ystad-Metall som lades ner 1969. Ystad-Metall producerade ett stort antal klassiska designartiklar under 1920- och 1960-talet. Ljusstaken Liljan är en av designklassikerna som Skultuna valde att återuppta i produktion igen för några år sedan, då i samtyckte med Ivar Ålenius Björks släktingar. Tatlinvasen är en annan av dessa ikoniska produkter ritade av Ivar Ålenius Björk som Skultuna valt att lyfta fram och återuppta produktionen på igen.', 159),
(35178, 'Flasköppnare Ekollon ', 'En flasköppnare i solid mässig i form av ett ekollon. Blir till både ett användbart verktyg med också en fin inredningsdetalj. En fin gåva att ge bort som present. ', 181),
(35179, 'Flasköppnare golfboll', 'En flasköppnare i solid mässig i form av en golfboll. Blir till både ett användbart verktyg med också en fin inredningsdetalj. En fin gåva att ge bort som present. \r\n', 181),
(35182, 'Orbis vas ', 'Minivasen Orbis är ett nytillskott i kollektionen Orb. Orbis är en nätt vas i två delar som passar perfekt att dekorera bordsdukningen med. Orbis har samma omslutande känsla som sina större syskon, och fungerar lika bra solitär som placerad i kluster om flera. Orbis glaskupol ger ett naturligt stöd till mer sköra och tunna blomstjälkar samtidigt som det munblåsta glaset skyddar blomman.', 159),
(35184, 'Eucalyptus', 'Konstgjord eucalyptus av högsta kvalité för att skapa en naturtrogen känsla i ditt hem. Passar perfekt i vas eller kruka. Mixa och kombinera med andra snittblommor för att skapa en ståtlig bukett. ', 447),
(35188, 'Grankvist ', 'Här är perfekta inredningsdetaljen - Grankvist som aldrig barrar utan består år efter år. Konstgjord kvist gjord av högsta kvalité för att skapa en naturtrogen känsla i ditt hem. Ståtlig kvist som skapar botanisk känsla i ett helt rum.', 447),
(35189, 'Staty Godess', 'Unik och en mycket fin inredningsdetalj tillverkat i resin och kristallglas. \r\n\r\nMått: 33x9cm', 0),
(35190, 'Magnolia', 'Här är perfekta inredningsdetaljen - Magnolia som alltid blommar. Konstgjord magnoliakvist gjord av högsta kvalité för att skapa en naturtrogen känsla. Ståtlig blomma som skapar botanisk känsla i ett helt rum.', 447),
(35194, 'Sidobord Florence', 'Elegant sidobord Florence från Eichholtz i den snygga kombinationen utav guld, svart och glas. Finns även i soffbord. ', 423),
(35195, 'Soffbord Florence.', 'Elegant soffbord Florence från Eichholtz i den snygga kombinationen utav guld, svart och glas. Finns även i sidobord.', 419),
(35196, 'Sphere Table - Guldpläterat i klarglas', 'Sphere soffbord har en ren design och tack vare sin runda form kan den mjuka de raka linjerna som dominerar de flesta rummen. Detta bord har en elegant guldpläterad yta, gjord för hand i Sverige. Bordsskivan är tillverkad i härdat glas.\r\n\r\nMått: W 98, D, 98, H 44 cm\r\n\r\nMaterial: Rostfritt stål, guldpläterad yta och toppskiva av härdat glas. \r\n\r\nVarumärke: Ruth & Joanna', 123),
(35197, 'Shelby Sideboard - Mässing & Glas', 'Detta eleganta sidobord, är designad och utformad med enkla och tunna linjer i mässing toppat med en en skiva av glas. Det ger en luftig känsla och utstrålar  klassisk elegans. Passar perfekt att placera i både hallen, vardagsrummet eller salongen. \r\n\r\nProduktinformation:\r\nMått: W 115 cm, H: 78 cm, D: 40 cm\r\nMaterial: Rostfritt stål, polerad mässingsfärg, härdat klart glas\r\n\r\nVarumärke: Ruth & Joanna \r\n ', 240),
(35198, 'Layer side table - Polerad mässing spegelglas', 'Layer Table är det perfekta sidobordet tack vare dess nätta storlek och form. Bordet är uppbyggt i tre lager av spegelglas. Perfekt att placera bredvid din soffa, din säng eller som ett bord för dina bästa flaskor och dryckesglas.\r\n\r\nMått: W50, D, 50, H 59 cm\r\n\r\nMaterial: Stål, polerat mässingsfärg och bordsskiva i spegelglas.\r\nVarumärke: Ruth & Joanna', 122),
(35200, 'Fleur side table - Polerad mässing / klarglas', 'Fleur Table har en snygg, funktionell design i klassiska materialval där mässing möter klarglas. Stilrent och elegant på samma gång. Fint att placera en vacker lampa på bredvid din soffa, eller som ett sängbord i sovrummet. \r\n\r\nMått: W 38, D 36, H 57cm\r\n\r\nMaterial: Rostfritt stål, polerat mässingsfärg och klart härdat glas.', 122),
(35201, 'Cara ottoman ', 'Denna skönhet som är avsedd att fungera som en iögonfallande extra sittplatser i ett rummet. Cara Ottoman har det lilla extra tack vare sin metallbas i en polerad mässingsfinish. Dess enkla men stilfulla design går fint att kombinera i de hem som är både moderna eller traditionella.\r\n\r\nStorlek: D: 60 cm, H: 38 cm\r\n\r\nMaterial: Ram i plywood och skum, bas i rostfritt stål med polerad mässing, sammet stof\r\n\r\nVarumärke: Ruth & Joanna', 112),
