(35231, 'Porto karmstol', 'Inred ditt vardagsrum eller kök med en stilren och klassisk karmstol i vackert läder. En snygg inredningsdetalj. Då det är handgjort kan detta variera lite. Lädret kommer få djup och en lyster av tid, användning och ljus. Stolen kan variera i färg beroende på att det sker i olika produktionsessioner.', 125),
(35232, 'Porto barstol', 'Inred ditt vardagsrum med en stilren och klassisk barstol i vackert läder. En snygg inredningsdetalj. Då det är handgjort kan detta variera lite. Lädret kommer få djup och en lyster av tid, användning och ljus. Stolen kan variera i färg beroende på att det sker i olika produktionsessioner. \r\n\r\nMått: 40x47x97cm\r\nRyggstödets mått: 25cm', 127),
(35233, 'Porto matstol', 'nred ditt vardagsrum eller kök med en stilren och klassisk matstol i vackert läder. En snygg inredningsdetalj. Då det är handgjort kan detta variera lite. Lädret kommer få djup och en lyster av tid, användning och ljus. Stolen kan variera i färg beroende på att det sker i olika produktionsessioner.', 125),
(35234, 'Cire Trudon Doftljus Prolétaire  270 g', 'Early mornings in bed with an exultant scent of hope and celebrations… The air exhales the fresh and green vapors of springtime. The Lily of the valley leads our hearts towards singing tomorrows and their sweet revenge !\r\n\r\nToppnot: Grönska, Liljekonvalj\r\nHjärtnot: Ros, Ylang-ylang\r\nBasnot: Musk\r\n\r\nVikt: 270g / 9.5 oz\r\nBrinntid: 55 till 60 timmar\r\nMått: H: 10,5 cm Ø: 9 cm', 287),
(35235, 'Cire Trudon Doftljus Ottoman 270 g ', 'Through the maze of Constantinople, under the ceilings of a hideaway, leathery scents and tobacco swirls of whispered discussions mingle with the rose and jasmine of dancing hair. A warm scent tinged with spices and honey whispers stories of an ancient empire.\r\n\r\nToppnot: Kanel, Nejlika, Saffran, Turkisk ros \r\nHjärtnot: Honung, Tobak, Rökt Läder \r\nBasnot: Musk, Patchouli.\r\n\r\nVikt: 270g / 9.5 oz\r\nBrinntid: 55 till 60 timmar\r\nMått: H: 10,5 cm Ø: 9 cm', 287),
(35236, 'Cire Trudon Doftljus Cyrnos 270 g', 'In its aromatic citrus garden, the sunny Cyrnos villa welcomed the flamboyant upper crust of early-20th century high society. Queens, poets and artists met in the shade of fig trees and parasol pines. They enjoyed a fabulous view and the easy life so typical of the blue Mediterranean shores. The villa benefited from Roquebrune’s air of scented lavender mixed with the dry aromas of Provence.\r\n\r\nToppnot: Citron, Myrtel, Timjan\r\nHjärtnot: Fikon, Cederträ, Lavender, Tall\r\nBasnot: Kasmir, Trä, Musk, Patchouli.\r\n\r\nVikt: 270g / 9.5 oz Brinntid: 55 till 60 timmar\r\nMått: H: 10,5 cm Ø: 9 cm', 287),
(35237, 'Cire Trudon Doftljus Balmoral 270 g', 'After the rain, mist rises from the plains in an earthy haze and humus. Damp ferns, sprouts and meadows… Under the green sun, already draining the storm, they surrender their herbaceous vapors to the passing wind.\r\n\r\nToppnot: Klippt gräs, Blad,  Mint\r\nHjärtnot: Iris, Tea\r\nBasnot: Musk, Tall, Sav\r\n\r\nVikt: 270g / 9.5 oz\r\nBrinntid: 55 till 60 timmar\r\nMått: H: 10,5 cm Ø: 9 cm', 287),
(35238, 'Cire Trudon Room Spray Abd El Kader ', 'A gust of freedom blowing from the Mascara coast and the mountains picks up on its way the green scents of fresh mint, the rashness of fights, ginger’s hot and peppered air and the perfume of tea and tobacco from the Ouled Nail tribe…\r\n\r\nToppnot: Svartvinbär, Nejlika, Ingefära, Citron, Mint \r\nHjärtnot: Jasmin\r\nBasnot: Vanilj\r\n\r\nVikt: 375 ml', 286),
(35239, 'Cire Trudon Estérel 270 g', 'Imported from Australia by British botanists at the turn of the 19th Century, mimosa has since become the Côte d’Azur’s floret: the solar bushes now blossom on the hillsides of the Esterel Massif. \r\nA wild vegetal composition, the Estérel perfume is as vibrant and delicate as the mimosa’s clusters.\r\n\r\nToppnot: Bergamot\r\nHjärtnot: Mimosa\r\nBasnot: Iris', 287),
(35240, 'Cire Trudon Six 270 g', 'SIX has a heart-to-heart with Cire Trudon.\r\nAn allegorical take on the 6th sense, the heart, SIX’s perfume revolves around a floral scent: white flowers and a lingering hint of monoi are an invitation to escape. Reassuring, the new scented candle further explores the mysteries of the heart: if the smell of carnation arouses memories of old lipsticks, touches of jasmine and vanilla picture a tropical landscape. \r\nFor the light-hearted, the candle’s leaflet encloses a series of colourful, hand-illustrated stickers: inside a cameo-shaped frame, each one portrays a sense. These small decorative elements can freely be placed on the candle, thus changing its appearance in a heartbeat! \r\n\r\nToppnot: Gardenia\r\nHjärtnot: Nejlika, Jasmine, Ylang-Ylang\r\nBasnot: Lilja, Vanilj\r\n\r\nVikt: 270g / 9.5 oz\r\nBrinntid: 55 till 60 timmar\r\nMått: H: 10,5 cm Ø: 9 cm', 287),
(35258, 'Stearinljus Royal Blue 12-pack ', 'Vackra handstöpta och olackade stearinljus från Ester & Erik i Royal blue. Droppfria och självsläckande ljus som slocknar ca 2 cm innan ljusets botten. \r\n\r\nSäljs i 12-pack.', 160),
