(35567, 'Bordsduk Paradise Dark blue', 'Bordsduk Paradise Dark blue av vackert tidlöst linnetyg. Klä ditt bord till vardags eller fest med en exklusiv duk som är klassisk och slitstark. En duk som är lika vacker år efter år. Tvättas i 30 grader genom ett mjukt program (silke/ull) med ett tvättmedel utan blekmedel. Torktumlas inte.\r\n\r\n\r\nMått: 150x230cm', 174),
(35568, 'Bordsduk Paradise Green ', 'Bordsduk Paradise Green av vackert tidlöst linnetyg. Klä ditt bord till vardags eller fest med en exklusiv duk som är klassisk och slitstark. En duk som är lika vacker år efter år. Tvättas i 30 grader genom ett mjukt program (silke/ull) med ett tvättmedel utan blekmedel. Torktumlas inte.\r\n\r\nMått: 150x230cm ', 174),
(35569, 'Kuddfodral Paradise Dark blue ', 'Kuddfodral Paradise Dark blue ett klassiskt fodral som passar perfekt att matcha med bordsduken Parardise. Tvättas i 40 grader genom ett mjukt program (silke/ull) med ett tvättmedel utan blekmedel. Torktumlas inte.\r\n\r\nMått: 50x50cm', 211),
(35570, 'Miss Annie - Poster', 'Att födas utan vingar i Fåglarnas Land är svårt och ibland tar det tid att upptäcka den gåvan man fått. Vid födseln fick Annie en stor örn som skulle skydda henne tills hennes begåvning utvecklades. Men en dag sågs två enorma fåglar högt uppe på himlen, det visade sig att Miss Annie när som helst kunde byta skepnad och bli den modigaste örnen riket någonsin skådat.\r\n\r\nPostern är 50x70 cm och tryckt på 170g Munken Polar Rough matt papper för att bibehålla den fina känslan av originalet i akvarell. Limiterad upplaga, när den är slut är den slut för alltid.\r\n', 269),
(35572, 'Miss Olivia', 'Länge kunde Miss Olivia inte gå. Det spelade inte så stor roll för vingarna bar henne dit hon skulle. Hon läste hellre än något annat. Hon blev bildad långt tidigare än hennes jämnåriga och hennes kunskap inom historia och geografi blev snabbt erkänt över hela fåglarnas rike.\r\n\r\nPostern är 50x70 cm och tryckt på 170g Munken Polar Rough matt papper för att bibehålla den fina känslan av originalet i akvarell. Limiterad upplaga, när den är slut är den slut för alltid. ', 269),
(35573, 'Mini Bird Master', 'Mini Bird Master, som kallas MBM av landets alla invånare, är kemist. Hon bor på ett moln där hon också har sitt mystiska lab. Från molnet som tycks ligga allra högst upp i himlen, sprids dofter, ljud och ljus som alltid kan härledas till MBM’s spännande experiment. Experiment som en dag ska visa sig väldigt användbara.\r\n\r\nPostern är 50x70 cm och tryckt på 170g Munken Polar Rough matt papper för att bibehålla den fina känslan av originalet i akvarell. Limiterad upplaga, när den är slut är den slut för alltid. ', 269),
(35574, 'Dear Whalie', 'Whalie har alltid känt sig stor och klumpig, en känsla av att han aldrig passar in och alltid tar upp för mycket plats. Men istället för att lägga all sin energi på det, har han fått lära sig att alla levande varelser har en speciell plats att fylla, man behöver bara vänta på att rätta tillfället ska dyka upp, då vet man. Då känner man det i valsjälen.\r\n\r\nPostern är 50x70 cm och tryckt på 170g Munken Polar Rough matt papper för att bibehålla den fina känslan av originalet i akvarell. Limiterad upplaga, när den är slut är den slut för alltid. ', 269),
(35575, 'Mr Simon', 'Mr Simon föddes med extremt bra hörsel. Han kunde tidigt skilja på alla arters kvitter och började senare höra in i framtiden. Kanske var det därför han tidigt fick jobbet som röstspion i det stora fågelpalatset. Hans jobb är mycket hemligt och ger honom hög aktning hos de som vet.\"\r\n\r\nPostern är 50x70 cm och tryckt på 170g Munken Polar Rough matt papper för att bibehålla den fina känslan av originalet i akvarell. Limiterad upplaga, när den är slut är den slut för alltid. ', 269),
(35576, 'Servett Linne Dark Blue ', 'Duka bordet med en vacker servett i klassiska mörkblå ränder. Textil till bordet ger ett exklusivt och fullbordat intryck. Placera gärna servetten i en servering för det lilla extra. ', 172),
