(35861, 'Coaster  Balmoral', 'A new addition to Cire Trudon’s series of objects, six glass coupelles welcome Mynott’s spirited illustrations: with their felt-base, the small plates are ideal to display scented candles.\r\nThrough the glass, the humoristic drawings mirror the stories behind Cire Trudon’s iconic perfumes: one recognises Villa Cyrnos’ elegant architecture, Ernesto’s cigar and the scent of fresh tobacco leaves or La Marquise’s silhouette, absorbed in what seems like a fascinating book. More spiritual, Nazareth’s shining star goes in pairs with Carmélite: look out for a sister wearing sunglasses in the religious crowd!\r\n\r\nA decorative take on Cire Trudon’s art de vivre.\r\n\r\nDiameter: 10,5cm ', 184),
