(35875, 'Vaugondy Black ', 'EVEN HISTORY AND SCIENCE CAN BE PLAYFUL. A ?MUST? CLASSIC IN STARK GRAPHIC LINE-ART AND EXECUTED IN VARIOUS SIZES. SPHERES ARE AFTER ALL HOME DÉCOR PUR-SANG, AND WHAT BETTER SPHERE THAN THE ANTIQUE WORLD. EASY TO KEEP ON EYE LEVEL AND TO FOLLOW MAGELLAN AND OTHER EARLY HEROES OF EXPLORATION. SAIL SUNDA STRAIT, FILL THE HOLD AT THE SPICE ISLANDS, EVADE THE PIRATES FROM MADAGASCAR AND ROUND THE CAPE, THEN SAIL UP TO BRAZIL AND CROSS THE ATLANTIC FOR A SAFE LANDING IN 18TH C. AMSTERDAM…', 466),
