(35877, 'Dora Maar Bordslampa', 'nspired by Dora Maar, the French photographer, poet, and painter best known for being a lover and muse of Pablo Picasso. A grey silk shade tops unglazed porcelain with polished nickel details.\r\n\r\nJonathan throws the models for the Muse vessels and then substitutes our signature geometric relief patterns with body parts—faces, breasts, lips—to create a surreal style. Each piece is made from unglazed matte porcelain to accentuate the forms and is inspired by our favorite artists\' muses.\r\n\r\nDimensioner\r\nLampfot: ø 23.5  x  30.48 cm\r\nLampskärm: ø 45.72 x 35.56 cm ', 144),
(35879, 'Zodiaker - Råttan', 'RÅTTAN - Man tros få olika egenskaper beroende på vilket djur eller stjärntecken man är född i. Även själva årets energier smittar av sig på alla människor, inte bara dem som föddes då. Inom kinesiskt horoskop är det vilket år man är född som avgör vilket stjärntecken man är född i. \r\n\r\nAtt ställa ett kinesiskt horoskop är helt annorlunda än att ställa ett västerländskt. Kineserna tänker sig åren i cykler där varje år representeras av ett djur och ett element. Det finns 12 olika djur och fem element och därför är en fullständig cykel 60 år lång. Efter det börjar det om. Det kinesiska horoskopet bygger på månens rörelser. Det är alltså inte solen som står i centrum som den gör i väst. Året börjar någon gång mellan januari och februari och de exakta datumen skiljer sig från år till år.\r\n\r\nÅr som var råttans år: 1924, 1936, 1948, 1960, 1972, 1984, 1996, 2008. ', 466),
