(35891, 'CROWN Taklampa M OUTLET', 'CROWN Taklampa M (20 glödlampa)\r\nMått: Ø 105 x h 60 cm\r\n\r\nBegränsat antal i vår outlet på grund av retur, finns även till ordinarie pris. ', 145),
(35892, 'ELMWOOD Coffeetable Old Elm OUTLET', 'Soffbord med bordskiva i almträ på en järnställning. \r\nLängd 130 cm x Bredd 75 cm x Höjd 43 cm\r\n\r\nBegränsat antal i vår outlet på grund av retur, finns även till ordinarie pris. ', 123),
(35894, 'Banana Bud Vase ', 'Banan Bud vas från Jonathan Adler. Här kommer en fantastisk liten vas med lite Freudianska vibbar. Det härliga skalet som sakta avtäcker den ståtliga frukten är lite insinuerande. Det blir en härligt annorlunda vas att ha fina blommor i. \r\n\r\nMått: 15.24 x 12.7 cm', 159),
(35895, 'Dora Maar Pedestal Bowl', 'More than just a pretty face, our Dora Maar Pedestal Bowl is poised to dazzle from every angle. Inspired by Dora Maar, the French photographer, poet, and painter best known for being a lover and muse of Pablo Picasso.\r\n\r\nJonathan throws the models for the Muse vessels and then substitutes our signature geometric relief patterns with body parts—faces, breasts, lips—to create a surreal style. Each piece is inspired by our favorite artists\' muses.\r\n\r\nMått: ', 159),
(35896, 'Dora Maar Giant Centerpiece Bowl', 'Our larger-than-life Dora Maar Centerpiece Pedestal Bowl is the grand head-turner every dining experience deserves. Inspired by Dora Maar, the French photographer, poet, and painter best known for being a lover and muse of Pablo Picasso.\r\n\r\nJonathan throws the models for the Muse vessels and then substitutes our signature geometric relief patterns with body parts—faces, breasts, lips—to create a surreal style. Each piece is inspired by our favorite artists\' muses.', 159),
(35897, 'Giant Gala Vase', 'An expressive collection of moody mouths wrap an oversized vessel crafted from high-fired unglazed porcelain. Beguiling in rest or playfully puckered, our lips—framing tongues, holding pills, highlighting hardware, flaunting flowers—add a kiss of cool to your table, mantel, or shelf.\r\n\r\nInspired by Gala, wife and muse of Salvador Dali.\r\n\r\nJonathan throws the models for the Muse vessels and then substitutes our signature geometric relief patterns with body parts—faces, breasts, lips—to create a surreal style. Each piece is made from unglazed matte porcelain to accentuate the forms and is inspired by our favorite artists\' muses.', 159),
(35898, 'Pall Patch OUTLET', 'Pall patch i svart/vit koskinn. Varje pall är unik. \r\n\r\nMått: ø 35 h 45 cm', 112),
