(36650, 'Cire Trudon Doftljus Rose Gold Ernesto 270g', 'ERNESTO - CHRISTMAS\r\nIn a hotel of Havana, under the fixed sun of the Revolution : the fierce and partisan overtones of leather and tobacco meddle with the paneling’s waxen silence. In the cool dimness, fawn grimaces shimmer along with the smoke of cigars and the barrels of guns.\r\n\r\nHead Notes:\r\nBergamot, Grapefruit, Rhum.\r\nHeart Notes:\r\nClove, Labdanum, Oak Wood, Patchouli.\r\nBase Notes:\r\nAmber, Leather, Moss, Tobacco.\r\n\r\nVikt: 270g / 9.5 oz\r\nBrinntid: 55 till 60 timmar\r\nMått: H: 10,5 cm Ø: 9 cm', 0),
(36653, 'Bookstand Svart', 'Bokstöd – Stilrent och kraftigt bokstöd i svart acryl med ett glasliknande utseende som även passar till våra största böcker. Vacker att använda som en inredningsdetalj då varje blad i en bok har ett unikt utseende. Perfekt för att ge din favorit bok uppmärksamheten den förtjänar.\r\n\r\nMått: 30x32cm', 0),
(36655, 'Spode Blue Italian Grytvante', 'Grytvante H 36,5 x B 19,5 cm. Väldetaljerad med inspiration ur den äldre Italienska landsbygden med bårder utav ett 1700-tals Imari Oriental, vilket även kännetecknar det världsberömda Blue Italian.', 0),
(36667, 'Infinity Ljuslykta Svart Small', 'Fin ljushållare från Skultuna i svart och mässing. \r\nSkultuna har tillsammans med svenska designerduon Bernadotte & Kylberg skapat den genuina ljuslyktan Infinity. \r\n\r\nGenom att dela en cylinder kan man placera ljusreflektorerna (eller skärmarna) på ett sätt som passar in i rummet eller där den är placerad. Skärmarna inte är fästa vid varandra ger användaren alla möjligheter till att förändra dess utseende.', 0),
