(36885, 'Stoff nagel stand krom', 'Nagel Stoff ställning 1st modul. Reproduktion av Caesar Stoff för Fritz Nagel modulljusstake från 1965. Säljs i byggbara moduler. Kommer i en snygg presentförpackning. Reproduktionen av Nagelljusstakarna sker under licens med Nagel Gmbh, helt efter originalet. Mycket vacker som en skulptur utan ljus. Köp flera moduler och sätt samman till din egen unika Stoff ljusstake.', 0),
(36892, 'Mr Elliot - Poster', '…Elliott sitter länge och tittar ut mot den svindlande horisonten. Den gula manen blåser i vinden och i ögat faller långsamt en tår. Ännu en gång har han sagt farväl till en vän och hans uppdrag är avslutat. Med bravur. Genom sin ständiga närvaro och sin förmåga att utmana rädslan tar han hand om barn vars mod och äventyrslust försvunnit.\r\n\r\nPostern är 50x70 cm och tryckt på 170g Munken Polar Rough matt papper för att bibehålla den fina känslan av originalet i akvarell. Limiterad upplaga, när den är slut är den slut för alltid. \r\n\r\nMått: 50x70 cm', 0),
(36893, 'Miss Elba - Poster', '…Utan att ta blicken från sin vän känner hon hoppet komma tillbaka. Dagar av ensamhet tar plötslig vändning när värmen från det lilla djuret sprider sig till insidan av hennes handflator. Varm päls ger tröst och framtiden är spännande. Elba känner styrka i drömmen om en morgondag fylld av mod att vilja öppna dörrar till nya äventyr.\r\n\r\nPostern är 50x70 cm och tryckt på 170g Munken Polar Rough matt papper för att bibehålla den fina känslan av originalet i akvarell. Limiterad upplaga, när den är slut är den slut för alltid. \r\n\r\nMått: 50x70 cm', 0),
