(36905, 'Riva Aquarama Cream', 'Modellbåten Riva Aquarama Cream av lyxigt krämfärgat läder och detaljer i trä och metall för tankarna till 50- och 60-talens eleganta yachtliv. Riva Aquarama med sin skönhet, snabbhet och sitt utsökta hantverk, kallas ofta för båtvärldens Ferrari. 1996 byggdes den sista varianten av Riva Aquarama, men den anses fortfarande av många som den vackraste båt som någonsin tillverkats.\r\n\r\nMått: L 89 x B 27 x H 23 cm', 0),
(36906, 'Riva Aquariva Super', 'Lyxig och stilfull modellbåt av typen Aquariva Super, som tillverkas av båtmärket Riva. Ett riktigt frosseri i italiensk design med sin rundade sits i läder och skrov av mahogny. Prydnadsbåt som passar lika perfekt hos dig som är en riktig båtfantast, som hos dig som är ute efter en extra elegant inredningsdetalj. Tillverkad i trä med lyxiga detaljer i läder och metall.\r\n\r\nMått: L 89 x B 27 x H 23 ', 0),
(36907, 'Riva Typhoon', 'Elegant modellbåt som föreställer The Typhoon, som specialbyggdes runt 1930-talet på uppdrag av racerbåtsentusiasten Edsel Ford, son till Henry Ford som skapade Ford Motor Company. Tanken var att Edsel Ford skulle tävla med båten, därför utformades den som en extra snabb motorbåt. Dock användes den slutligen endast som fritidsbåt. Riva Typhoon är en prydnadsbåt i trä med lyxiga detaljer i läder och metall.\r\n\r\nMått: L 98 x B 22 x H 21 ', 0),
(36908, 'Riva Modern', 'En moderna variant av vintagebåtarna av märket Riva. Fortfarande med mahogny, läder och metall som huvudsakliga ingredienser. För mer än 20 år sedan byggdes den sista Riva-båten med mahognyskrov och ersattes av plast. Men det innebar inte slutet på det goda hantverket. Mahognydetaljer är fortfarande vanligt förekommande på Rivas lyxbåtar. Denna modellbåt är i trä med eleganta detaljer i läder och metall.\r\n\r\nMått: L 89 x B 27 x H 29 cm', 0),
