(37454, 'VO Anise Patchouli doftljus', 'Doftljus i ett frostat bärnstensglas med doft av anise patchouli. Nyckelingrediens består av 100% vegetabiliskt wax. Ljuset har en hög koncentration av doft vilket gör att den delikata doften sträcker sig genom fler rum. När ljuset brunnit ner kan du använda det vackra frostade glaset som dekoration. \r\n\r\nSkär veken så att den alltid är ca 1 cm innan du tänder ljuset. Brinntid är cirka 40 timmar. ', 0),
(37455, 'VO Incense Lavender doftljus ', 'Doftljus i ett frostat bärnstensglas med doft av anise patchouli. Nyckelingrediens består av 100% vegetabiliskt wax. Ljuset har en hög koncentration av doft vilket gör att den delikata doften sträcker sig genom fler rum. När ljuset brunnit ner kan du använda det vackra frostade glaset som dekoration. \r\n\r\nSkär veken så att den alltid är ca 1 cm innan du tänder ljuset. Brinntid är cirka 40 timmar. ', 0),
(37456, 'Louis Vuitton Catwalk', 'Founded as a luxury leather goods house in 1854, Louis Vuitton was for many decades one of the world’s leading trunk and accessories makers. It was after launching its first fashion collections in 1998, however, that the house reached unprecedented global fame, and pioneered high-profile collaborations with artists such as Richard Prince, Takashi Murakami and Stephen Sprouse.\r\n\r\nThis definitive publication opens with a concise history of the house, followed by brief biographical profiles of Marc Jacobs, the first creative director (1998–2014), and Nicolas Ghesquière, who helms the brand today, before exploring the collections themselves, organized chronologically. Each collection is introduced by a short text unveiling its influences and highlights, and illustrated with carefully curated catwalk images. Showcasing hundreds of spectacular clothes, details, accessories, beauty looks and set designs – and, of course, the top fashion models who wore them on the runway, from Naomi Campbell and Gisele to Kate Moss and Cara Delevingne. A rich reference section, including an extensive index, concludes the book.', 0),
(37457, 'Chanel - The Karl Lagerfeld Campaigns', 'When Karl Lagerfeld was named at the helm of the fashion house in 1983, he set out to radically shake up and update its image – not only through bold collections but also, from 1987 onwards, by choosing to shoot the house’s campaigns himself, a move that was unprecedented for a fashion designer.\r\n\r\nConceived in collaboration with Karl Lagerfeld and the House of Chanel, this definitive publication opens with an essay by Patrick Mauriès before exploring the campaigns themselves, organized chronologically. A carefully curated selection of images showcases hundreds of spectacular clothes worn by the top fashion models – and personalities – of each era, from Inès de la Fressange, Claudia Schiffer, Kate Moss and Cara Delevingne, to Kirsten Stewart and Lily Rose Depp, captured in glamorous locations, from Coco Chanel’s Paris apartment to the French Riviera or LA.\r\n\r\nPresented in a high-end, slipcased package, Chanel: the Karl Lagerfeld Campaigns offers an unrivalled overview of the house of Chanel as seen through the eyes – and lens – of Karl Lagerfeld himself.', 0),
(37458, 'LV - Cabinet of Wonders', 'A collector since his childhood, Gaston-Louis Vuitton (1883–1970) accumulated thousands of objects over his lifetime. His wide interests and voracious curiosity were intimately bound up with the future of the family business and with travel. In addition to forming his own collection of trunks – his primary motivation and the one he announced publicly – Gaston-Louis’s roving eye lit upon rare antique travel articles, locks, hand tools, perfume bottles, tribal arts, walking sticks, vintage children’s toys, books, hotel labels, printed monograms and other typographical rarities. Together they form a rich personal evocation of curiosités industrielles, or curiosities of the trade, as he liked to call them.\r\n\r\nThis collection will capture the imagination of anyone inspired by bizarre and eclectic curiosities, or those with an interest in the cultural taste of someone who lived through the height of the Art Deco period – indeed, someone whose life was defined by the rigours and rewards of world travel.', 0);
