(37459, 'Chloe - Attitudes', 'This handsome volume chronicles the rise of the fashion house Chloé, a crucible of creativity for some of fashion’s most notable designers. The fashion brand Chloé may be sixty years old, but she still exudes a youthful elegance and femininity. As the first high-end Paris fashion house to sell exclusively ready-to-wear clothing, Chloé has since redefined its look for the modern woman with flattering colors, quality materials, and a series of must-have It bags. Chloé started in 1952 when Gaby Aghion invented the revolutionary idea of luxury prêt-à-porter, taking the craftsmanship of haute couture and making it available to a wider audience. Her focus on the beautiful yet wearable gave the line currency with chic young women. Born in Egypt in 1921 and moving to Paris when she was in her twenties, Aghion dressed some of the most fashionable and powerful women of her day, including Jackie O, Grace Kelly, and Brigitte Bardot. Her vision has always been maintained through the company’s extensive career. The company’s lively and fresh energy has been sustained through the decades partly because it seeks out new talent, including then-28-year-old designer Karl Lagerfeld, who started with the company in 1966. The book explores his career at Chloé, along with Martine Sitbon (in 1988), Stella McCartney, who joined Chloé when she was 26 (in 1997), and Phoebe Philo, who was responsible for Chloé’s major reinvention from 2001 to 2006, where she is credited for bringing a sensual and personal touch to the line. It is currently helmed by Clare Waight Keller, who previously reinvigorated the fashion line Pringle of Scotland. Chloé, in short, is the modern woman—refined and redefined.', 0),
(37460, 'Dior Glamour: 1952-1962', 'A collection of the lavish and iconic gowns of Christian Dior, from the 1950s and ’60s, captured by the legendary photographer Mark Shaw. Iconic photographer Mark Shaw documented the ultra-exclusive Parisian fashion world, focusing on Paris’s long-standing top couturier Christian Dior. Shaw’s photographs—some of the first fashion photographs ever shot in color—capture the most stunning and extraordinary fashion of the era. This lavish volume embodies the glamour of that time, from rare moments of Christian Dior during fittings to editorial-style photographs of models, socialites, and actresses posing in Dior’s ballgowns, day suits, and haute couture collections. Shaw’s photojournalistic style changed fashion photography forever: his approach was to photograph wide, giving the subject a sense of context, creating an environment as exquisitely transformative as the subject and garment. With an eye for intimacy and opulence, this book features more than 200 color and black-and-white photographs, many never published before, having only recently been found in a secret vault by his estate. Dior Glamour: 1952–1962 captures the drama and elegance of the period’s style and will be treasured by lovers of photography, fashion, style, history, and cultured living.', 0),
(37461, 'Dior Images: Paolo Roversi', 'A stunning visual tribute to Italian photographer Paolo Roversi’s celebrated images for the house of Dior.\r\n\r\nA fashion house beloved for designs evoking modern Parisian elegance. A photographer renowned for hauntingly delicate portraits. This definitive volume, Dior Images: Paolo Roversi, is an ode to their legendary rapport.\r\n\r\nPresenting photographs from British Vogue, Vogue Paris, and W, this tome spotlights creations by Dior’s artistic directors Gianfranco Ferré, John Galliano, Raf Simons, and Maria Grazia Chiuri. It also contains exclusive pictures from a photoshoot supervised by Grace Coddington featuring designs by Christian Dior himself. Equal parts fashion monograph and photographic portfolio, this exquisite volume will enthrall photography, style, and art lovers.', 0),
(37462, 'Fornasetti: The Complete Universe', 'This elaborate volume, authored by the designer’s son, is a splendid celebration of one of the world’s most inventive design minds. Combining whimsy and elegance, Piero Fornasetti (1913–1988) transformed everyday objects like cups, scarves, and screens into works of art featuring his idiosyncratic leitmotifs, such as the hand, the female face, and luminescent fish. Additionally, he created a wide range of works, including idealized architectural fantasy drawings, book designs, and provocative nudes, as well as the decor for the luxury liner Andrea Doria. Perhaps most famous for dazzling pieces of trompe l’oeil furniture, Fornasetti was rediscovered in the 1980s and has remained much sought-after by collectors worldwide. Featuring 2,800 illustrations, many never before published, the monograph is designed to be an \"artist’s book\" that reflects as faithfully as possible Fornasetti’s own approach to design. Fornasetti’s work is organized by type and includes paintings, sculptures and etchings, furniture, graphics, textiles, glass, screens, trays, and ceramics, as well as smaller categories. With unique and exhaustive access to the archives, this epic undertaking covers detailed technical, biographical, and bibliographical information, including a list of exhibitions and a register of the complete works. A must-have for collectors and connoisseurs alike.', 0),
(37463, 'Lanvin', 'Written by Dean L Merceron, Contribution by Harold Koda and Alber Elbaz\r\nThe House of Lanvin evolved from the creative force and remarkable energy of an extraordinary woman, Jeanne Lanvin. Her design career survived fifty-six successful and productive years. Lanvin is the oldest surviving couture house, in near-continuous existence from 1909 through the present day. Her body of work includes millinery, children’s wear, haute couture, fragrances, furs, lingerie, menswear, and interior design among others. The continuous public appeal and the youthful image of these couture creations are lasting aspects of Madame Lanvin’s career. At the heart of this book are key collections from 1909 through 1946, the year of Lanvin’s death. Original fashion illustrations, beading and embroidery swatches play a crucial role in demonstrating her intricate, creative, and innovative techniques. The house of Lanvin is currently experiencing a period of great acclaim, emerging as a darling of the press, Hollywood, and the larger fashion community. With the most modern of efforts, Alber Elbaz, the current design director, is drawing from the rich Lanvin tradition to create an award-winning collection that at once evokes, reveres, and reinvents the intentions of its founder', 0),
(37465, 'Volez Voguez Voyagez: Louis Vuitton', 'Set to accompany the highly anticipated exhibition at the Grand Palais, Volez, Voguez, Voyagez — Louis Vuitton surveys the rich heritage and trajectory of the world’s most recognizable luxury brand. Before its foray into the realm of luxe ready-to-wear and accessories, Louis Vuitton was known as pioneer in the field of leather goods, developing its diverse luggage line during the Industrial Revolution, a historic period which saw a ground-breaking development in the means of travel and transportation. Louis Vuitton grew to be known as the fashion house that embodied the spirit of travel and quintessentially French elegance through its array of handcrafted artisanal wares.\r\n \r\nEdited by Olivier Saillard, the distinguished French curator of the Volez, Voguez, Voyagez — Louis Vuitton exhibition, this lavishly illustrated catalogue features new and archival photography, original design sketches from the early 1900s, past and current advertising campaigns, images of ready-to-wear and luggage for modern celebrities, and detailed close-up imagery of the exhibition items including the first trunks from 1906, the “Malles classiques” trunks, cabin luggage, instrument suitcases, traveling accessories such as trench coats, leather gloves, hat boxes, and elegant canes, delicate jewelry boxes, celebrity luggage, and much more. Split into nine themes to follow the structure of the exhibition, the book’s fascinating imagery is also accompanied by exploratory texts that weave themes of traveling lifestyle. Reflecting on Louis Vuitton’s celebrated past and present, Volez, Voguez, Voyagez — Louis Vuitton is an ambitious volume that journeys through the evolution of travel and the French house’s continually evolving design inspiration which continually walks the line between classic style and modernity.', 0),
