(37478, 'The Ferrari Book - Passion for Design', 'On over 400 pages, editor Michael Köckritz, author Jürgen Lewandowski and photographer Michel Zumbrunn get up close and personal with the Ferrari phenomenon: its beauty and sex appeal, its class and power. Readers will learn about not only the most popular models, but also the most important designers who have shaped Ferrari\r\n\r\nIncludes many exciting stories and anecdotes surrounding the legendary brand and its automotive icons\r\n\r\nThe attractive design by Charles Blunier & Co. and a clean, uncluttered layout ensure the proper presentation worthy of the vehicles from Maranello.\r\n\r\nSuccess is not founded on miracles, but is almost always the product of a clear concept—the pinnacle of an ambitious, even stridently innovative idea. However, the aura of Ferrari does indeed approach the miraculous. What lies behind this phenomenon? What is the source of fascination for a brand whose creative designs are internationally recognized and enthusiastically received? First, even today—70 years after the company was founded—the miracle of Ferrari is still due in large part to the personality of Il Commendatore, Enzo Ferrari. Patience, passion, and being hard on himself and those around him gave the brand, under the emblem of the Cavallino Rampante, the power to become what it is today: sheer fascination on four wheels. Second, the long list of international racing victories is equally important. There is no class, no competition, that Ferrari did not set its sights on and win more or less immediately during the company’s last 70 years. Finally, Ferrari is synonymous with aesthetics, elegance, and trend-setting design. The true value of a brand and its products is measured in the currency of impassioned devotion. This is the third and perhaps most vital element confirming the Ferrari miracle: The Ferrari Book – Passion for Design traces the evolution of the miracle and lets us experience passion given automotive form in a large and engrossing format.', 0),
(37479, 'Ultimate Toys for Men', 'From the Italian luxury sports car to the Swiss chronograph—the ultimate collection of the best, most exclusive, and most luxurious toys for men with a special section on bespoke production. An opulent photo book that opens up a world full of luxury, pleasure, and aesthetic beauty to the reader.\r\n\r\nThe perfect gift for all boys who have grown up, but preserved their inner child.\r\n\r\n \r\n\r\nThere are only two notable differences between toys for little boys and toys for grown-up boys: the toys get bigger with age—and more expensive. Matchbox cars give way to high-end sports cars, model boats become motorboats and sailing yachts, and the plastic wristwatch turns into a Swiss chronograph with a perpetual calendar and minute repeater. The Toys for Men series has always stayed abreast of this male drive to play; in the latest volume, we present the ultimate wish list, a selection of the most exclusive, most innovative, and most luxurious toys that men with money can buy. Of course, the list includes the classic male fantasies of executive jets, mega- yachts, and super sports cars—the truly giant and great things that move men in the air, on water, or on land. But it also includes the little gadgets—from headphones and wristwatches to SLR cameras—that make tech-loving men’s hearts beat a little faster. We also include the vices that speak to connoisseurs, like that special bottle of Spanish wine or one from the USA, Scottish whiskey, or cigars from the Dominican Republic. And last but not least, we include one of the greatest luxuries of all: having a product tailored to you and you alone, bespoke-style. But we’re not just talking about custom- tailored suits. Cars, golf clubs, skis, nearly everything today can be customized to suit your particular tastes. If you’re searching for the ultimate toys for the gentleman who has everything, you’ll hit pay dirt here. Because as philosopher Friedrich Nietzsche already knew, “There is a child hidden in every man: and it wants to play.”\r\n\r\nThe author, MICHAEL BRUNNBAUER, has been working in the media for ten years. After studying Economics at the European Business School (EBS) University of Business and Law in Oestrich-Winkel, Germany, he worked as an investment banker for Deutsche Bank. In 2005, he started studying at the Deutsche Journalistenschule (DJS) in Munich and after his studies, worked for the Financial Times Deutschland (FTD) daily newspaper and the magazine Gentlemen’s Quarterly (GQ). Michael Brunnbauer is now head of the men’s lifestyle magazine Provocateur for Meth Media Verlag in Austria. He founded the magazine in 2011 with Alexander Meth, a publisher. He is also a freelance writer for magazines and newspapers such as Robb Report, Die Weltwoche and Wired. His main topics include cars, watches, consumer electronics and design. Michael Brunnbauer grew up in Munich and has lived in London and San Diego. He’s a passionate collector of watches and whiskys.', 0),
