(37536, 'Classic Cars Review', 'A must-have book for all classic car fans worldwide\r\nAn indispensable survey for vintage car aficionados as much as curious newcomers\r\nBrimming with shiny spoke rims, stunning grilles, and magnificent wooden steering wheels\r\n\r\nFor decades, a passion for vintage motors was regarded as an eccentric hobby, particularly prevalent among the wealthy of an older generation. Today, classic cars have an ever larger, younger fan base. Events such as the Mille Miglia in Italy, the Festival of Speed at Goodwood in England, and Pebble Beach in the U.S. enjoy increasing popularity and booming visitor numbers, year after year. In an opulent coffee table book, Classic Cars Review celebrates the classic car phenomenon by presenting the most beautiful, exciting, and exclusive vintage vehicles, until now only visible in museums or behind the locked doors of private collections. It’s a Concours d’Élégance in book form, showcasing such icons as the Mercedes-Benz 300 SL Gullwing, Aston Martin DB5, and Maserati Sebring, as well as a multitude of extraordinary cars with remarkable histories—whether owned by well-known personalities or ushered in extraordinary successes on the racetrack. Many of these cars were produced in minimal runs or are one of few surviving models. In addition to the vehicles themselves, this must-have classic car book also shows the institutions and key players behind the exclusive vintage car scene. With large, never-before-seen collections and their collectors, Classic Cars Review provides exclusive insights into the world of the largest classic car auction houses, the most innovative classic car dealers, and all the key vintage car events.\r\n\r\n\r\nMICHAEL GÖRMANN does not have a job. At least, not in the conventional sense. For nearly 30 years, he has been working with his hobbies exclusively. The finer things in life—writing about and photographing them. Görmann\'s favorite topics: Anything that in some way moves. It should be loud and also smell like burnt rubber. The smell of gasoline is like perfume to him. His other subjects are watches and technical gadgets of all sorts. Is the engineering sophisticated and precise? Does it have buttons or controls? Does it require electricity or gas? If the answer to any of these is yes, then it is on his hunting radar. Görmann \"hones in on\" such quarry for an array of media outlets. After having finished his practical training at a daily newspaper, his experience includes having been the chief reporter of UHREN-MAGAZIN, (a magazine about watches), after which he founded two agencies and worked for publications such as Focus, Robb Report, Playboy, and Stern.', 0),
