(37567, 'Badborste med skaft', 'En badborste tillverkad i ek och tagel. Tagel är ett utmärkt material i badborstar då det är mjukt och följsamt samtidigt som det är kraftigt och tåligt och har en viss spänst. Tillsammans med en bra tvål ger den ett mjukt och skönt lödder för en perfekt rengöring. Det ihåliga taglet transporterar fukt vilket gör att slår du ut vattnet ordentligt efter användning så kommer taglet att kännas så gott som torrt. Låt borsten torka hängande eller stående på taglet så att vattnet transporteras bort från trät som är mer känsligt för fukt.', 0),
(37568, 'Lovisa Nagelborste ', 'Nagelborste i oljad ek och vit fiber. Dubbelsidig nagelborste som är både snygg och skön att hålla.Vit fiber är elastiskt och vattentåligt med en viss styvhet men utan att bli allt för hårt vilket gör materialet skönt och praktiskt vid rengöring av händer och naglar. Den kortare styvare borsten på ovansidan av borsten kommer effektivt åt och avlägsnar smuts under nageln.', 0),
(37569, 'Miniatyr Kupol Demi Dome Black', 'Som barn var vi nog många som var förtjusta i dockskåp som visades på museer och gallerier. Fascinationen för modeller i miniatyrer finns fortfarande kvar även när vi växer upp. Det är inte bara arkitekter som är intresserade av byggkonstruktion. Michelangelo och Da Vinci skapade småskaliga modeller av byggandes för deras kungliga och påvliga kunder. Låt denna vackra miniatyr modell i mahogany pryda ditt hem.\r\n\r\n46 x 25 x 41 cm', 0),
